        $data =[
            [129, 9, 'Bán Máy giặt LG', 9, NULL, '<p>Động cơ Inverter &ecirc;m &aacute;i, tiết kiệm điện</p>\r\n\r\n<p>Với động cơ truyền động trực tiếp Inverter hiện đại, m&aacute;y giặt LG FC1408S4W2 cho khả năng vận h&agrave;nh &ecirc;m &aacute;i, giảm thiểu tiếng ồn một c&aacute;ch tối đa, bạn c&oacute; thể ho&agrave;n to&agrave;n y&ecirc;n t&acirc;m v&igrave; m&aacute;y giặt sẽ kh&ocirc;ng ph&aacute;t ra tiếng ồn lớn cho d&ugrave; hoạt động v&agrave;o ban đ&ecirc;m. Hơn nữa, c&ocirc;ng nghệ Inverter c&ograve;n gi&uacute;p hạn chế lượng điện ti&ecirc;u thụ tối ưu, gi&uacute;p gia đ&igrave;nh bạn tiết kiệm chi ph&iacute; điện mỗi th&aacute;ng.</p>\r\n\r\n<p>C&ocirc;ng nghệ giặt 6 chuyển động [6 motion]</p>\r\n\r\n<p>Với c&ocirc;ng nghệ giặt 6 chuyển động được m&ocirc; phỏng theo b&agrave;n tay con người, m&aacute;y giặt LG FC1408S4W2 hỗ trợ điều khiển c&aacute;c chuyển động quay của lồng giặt một c&aacute;ch linh hoạt, gi&uacute;p quần &aacute;o kh&ocirc;ng bị xoắn rồi v&agrave;o nhau m&agrave; vẫn lu&ocirc;n sạch sẽ như được giặt bằng ch&iacute;nh đ&ocirc;i tay của bạn.</p>', 6000000, NULL, 0, 0, 1, NULL, '2019-08-23 12:57:21', '2019-08-23 12:57:21', NULL],
            [126, 9, 'Cần mua Máy Ảnh Canon', NULL, 9, '<p>Thiết kế gọn nhẹ</p>\r\n\r\n<p>M&aacute;y Ảnh Canon EOS 750D thuộc d&ograve;ng m&aacute;y ảnh chuy&ecirc;n nghiệp v&agrave; được thiết kế gọn nhẹ, bạn c&oacute; thể dễ d&agrave;ng mang theo trong qu&aacute; tr&igrave;nh di chuyển, đi xa v&agrave; thoải m&aacute;i chụp ảnh, quay phim trong thời gian d&agrave;i, m&aacute;y hạn chế t&igrave;nh trạng mỏi tay. Sản phẩm c&oacute; vỏ ngo&agrave;i thiết kế cứng c&aacute;p, bền bỉ v&agrave; b&aacute;ng cầm tay c&oacute; độ b&aacute;m, gi&uacute;p han chế trơn trượt v&agrave; hỗ trợ cầm nắm chắc chắn khi chụp.</p>\r\n\r\n<p>Cảm biến 24.2MP v&agrave; bộ xử l&yacute; h&igrave;nh ảnh DIGIC 6</p>\r\n\r\n<p>Canon 750D d&ograve;ng m&aacute;y ảnh DSLR&nbsp;sở hữu cảm biến 24.2 MP k&iacute;ch thước gi&uacute;p mang lại những h&igrave;nh ảnh đẹp c&oacute; k&iacute;ch thước lớn. Kết hợp độ ph&acirc;n giải lớn c&ugrave;ng bộ xử l&yacute; h&igrave;nh ảnh DIGIC 6 gi&uacute;p &nbsp;n&acirc;ng cao tốc độ xử l&yacute; v&agrave; chất lượng h&igrave;nh ảnh cao. Ngo&agrave;i ra, bạn cũng c&oacute; thể quay c&aacute;c đoạn video Full HD chuy&ecirc;n nghiệp hơn.</p>', 50000000, NULL, 1, 1, 1, NULL, '2019-08-23 12:48:34', '2019-08-23 12:48:34', NULL],
            [127, 9, 'Cần mua Honda Air Blade', NULL, 9, '<p>Thiết kế mạnh mẽ, ấn tượng</p>\r\n\r\n<p><strong>Xe M&aacute;y Honda Air Blade 2019</strong>&nbsp;mới được ra mắt c&ugrave;ng những đường n&eacute;t mạnh mẽ, mang đậm vẻ nam t&iacute;nh, với tem xe ho&agrave;n to&agrave;n mới v&agrave; logo ri&ecirc;ng ấn tượng, gi&uacute;p người d&ugrave;ng th&ecirc;m tự tin v&agrave; h&atilde;nh diện khi sở hữu.</p>\r\n\r\n<p>&Yacute; tưởng chủ đạo trong thiết kế của Air Blade 125 phi&ecirc;n bản mới vẫn hướng đến việc tạo ra chiếc xe tay ga thể thao đẳng cấp kh&aacute;c biệt, nhằm thỏa m&atilde;n niềm ki&ecirc;u h&atilde;nh của người sử dụng. Air Blade 125 phi&ecirc;n bản mới tiếp tục l&agrave; hiện th&acirc;n của sự đột ph&aacute;, hiện đại với diện mạo được trau chuốt tỉ mỉ đến từng chi tiết. Điểm nhấn phong c&aacute;ch đến từ tem xe mới cao cấp, hiện đại được thiết kế ri&ecirc;ng biệt cho từng phi&ecirc;n bản, gi&uacute;p nổi bật vẻ mạnh mẽ v&agrave; n&eacute;t cuốn h&uacute;t kh&oacute; cưỡng của mẫu xe</p>', 45000000, NULL, 0, 1, 1, NULL, '2019-08-23 12:52:28', '2019-08-23 12:52:28', NULL],
            [128, 9, 'Cần mua Đạp Điện Osakar ', NULL, 9, '<p>B&aacute;nh trước v&agrave;nh đ&uacute;c hợp kim th&eacute;p</p>\r\n\r\n<p><strong>Xe Đạp Điện Osakar A8</strong>&nbsp;c&oacute; b&aacute;nh trước được l&agrave;m từ v&agrave;nh đ&uacute;c hợp kim th&eacute;p với k&iacute;ch thước 18inch, được bố tr&iacute; thắng cơ ở t&acirc;m, với giảm s&oacute;c dầu &ecirc;m &aacute;i v&agrave; được bao quanh bởi lốp cao su kh&ocirc;ng ruột.</p>\r\n\r\n<p>Đ&egrave;n pha LED độ bền cao</p>\r\n\r\n<p>Xe đạp điện c&oacute; hệ th&ocirc;ng chiếu s&aacute;ng l&agrave; đ&egrave;n pha LED với khả năng chiếu s&aacute;ng cao, &iacute;t ti&ecirc;u hao năng lượng, được bố tr&iacute; ở đầu tay l&aacute;i cho người điều một tầm quan s&aacute;t an to&agrave;n khi vận h&agrave;nh.</p>', 15000000, NULL, 0, 1, 1, NULL, '2019-08-23 12:55:22', '2019-08-23 12:55:22', NULL],
            [125, 9, 'Bán Asus Vivobook', NULL, 9, '<p>M&agrave;u sắc thể hiện c&aacute; t&iacute;nh</p>\r\n\r\n<p><strong>Laptop Asus Vivobook A512DA-EJ422T AMD R5-3500U/Win10 [15.6 FHD]</strong>&nbsp;c&oacute; sẵn theo nhiều m&agrave;u ho&agrave;n thiện kh&aacute;c nhau để ph&ugrave; hợp với phong c&aacute;ch của bạn. M&agrave;u Bạc trong mang đến diện mạo b&oacute;ng bẩy v&agrave; tinh tế, hoặc h&atilde;y chọn m&agrave;u X&aacute;m đ&aacute; để tinh tế theo kiểu trầm lắng hơn. Bắt đầu một xu hướng mới với m&agrave;u Xanh l&ocirc;ng c&ocirc;ng đổi m&agrave;u đặc biệt: một lựa chọn độc đ&aacute;o c&oacute; thể thay đổi m&agrave;u sắc khi nh&igrave;n từ những g&oacute;c độ kh&aacute;c nhau. Nếu thực sự muốn nổi bật, bạn c&oacute; thể chọn m&agrave;u Hồng san h&ocirc; với lớp ho&agrave;n thiện tươi s&aacute;ng.</p>\r\n\r\n<p>Đ&acirc;y l&agrave; bộ đ&ocirc;i ultrabook nhiều sắc m&agrave;u nhỏ gọn nhất thế giới trong ph&acirc;n kh&uacute;c, đồng thời cũng l&agrave; d&ograve;ng laptop phổ th&ocirc;ng đầu ti&ecirc;n được trang bị bộ lưu trữ si&ecirc;u tốc dung lượng cao SSD 512GB Pcie gen 2 mạnh nhất hiện nay.</p>', 20000000, NULL, 0, 1, 1, NULL, '2019-08-23 12:45:14', '2019-08-23 12:45:14', NULL],
            [124, 9, 'Bán Laptop Hp 440', 9, NULL, '<p>Thiết kế sang trọng, đẹp mắt</p>\r\n\r\n<p><strong>Laptop HP ProBook 440 G6 5YM61PA</strong>&nbsp;c&oacute; thiết kế cứng c&aacute;p, bảo mật dễ v&agrave; nhiều t&iacute;nh năng được n&acirc;ng cấp, HP Probook 440 G6 ph&ugrave; hợp với m&ocirc;i trường doanh nghiệp. Laptop HP ProBook 440 G6-5YM61PA thừa hưởng nguy&ecirc;n vẹn dung mạo đặc trưng của d&ograve;ng Probook. Vỏ trong m&aacute;y trong sử dụng chất liệu nh&ocirc;m xước phần n&agrave;o mạnh mẽ hơn, c&ugrave;ng t&ocirc;ng m&agrave;u tối với cả m&agrave;n h&igrave;nh v&agrave; b&agrave;n ph&iacute;m. Hệ thống bản lề bo v&aacute;t tr&ugrave;ng xuống, được cải tiến chắc chắn hơn so với phi&ecirc;n bản cũ n&ecirc;n m&agrave;n h&igrave;nh &iacute;t bị rung hơn khi sử dụng. Kết cấu khung m&aacute;y bằng hợp kim chắc chắn, vỏ m&aacute;y phủ lớp nhựa mềm b&ecirc;n ngo&agrave;i. M&agrave;n h&igrave;nh g&oacute;i gọn trong phần viền c&ograve;n hơi d&agrave;y v&agrave; cục mịch nhưng c&oacute; th&ecirc;m lớp đệm chạy theo c&aacute;c viền bảo vệ, chống va chạm tốt hơn.</p>', 1500000, NULL, 0, 0, 1, NULL, '2019-08-23 12:43:13', '2019-08-23 12:43:13', NULL],
            [123, 9, 'Mua Samsung Galaxy Tab', NULL, 9, '<p><strong>Samsung Galaxy Tab E T561</strong></p>\r\n\r\n<p><strong>Samsung Galaxy Tab E T561&nbsp;</strong>c&oacute; thiết kế thời trang v&agrave; phong c&aacute;ch c&ugrave;ng mức gi&aacute; rất hấp dẫn. M&aacute;y được trang bị cấu h&igrave;nh phổ th&ocirc;ng với&nbsp;<strong>RAM 1.5GB</strong>,&nbsp;<strong>ROM 8GB</strong>, bộ vi xử l&yacute;&nbsp;<strong>4 nh&acirc;n</strong>&nbsp;c&ugrave;ng camera ra&nbsp;<strong>5.0MP</strong>&nbsp;v&agrave;&nbsp;<strong>2.0MP</strong>. M&agrave;n h&igrave;nh<strong>&nbsp;9.6 inch</strong>&nbsp;rộng r&atilde;i để người d&ugrave;ng c&oacute; thể sử dụng chức năng chia đ&ocirc;i m&agrave;n h&igrave;nh để n&acirc;ng cao hiệu quả l&agrave;m việc v&agrave; giải tr&iacute;.</p>', 2000000, NULL, 1, 1, 1, NULL, '2019-08-23 12:39:43', '2019-08-23 13:03:14', NULL],
            [122, 9, 'Bán  OPPO F7', 9, NULL, '<p>hiết kế tr&agrave;n viền &quot;tai thỏ&quot;</p>\r\n\r\n<p><strong>Điện Thoại Oppo F7&nbsp;</strong>tiếp tục xu hướng m&agrave;n h&igrave;nh tr&agrave;n viền tr&ecirc;n d&ograve;ng điện thoại OPPO với c&aacute;c cạnh m&aacute;y ở mặt trước được l&agrave;m mỏng, gọn cho trải nghiệm sử dụng ho&agrave;n to&agrave;n mới v&agrave; kh&aacute;c biệt so với phong c&aacute;ch truyền thống. Vẫn l&agrave; sự sang trọng v&agrave; đầy t&iacute;nh thời trang trong thiết kế của OPPO, OPPO F7 kho&aacute;c l&ecirc;n m&igrave;nh c&aacute;c đường n&eacute;t đầy tinh tế v&agrave; quyến rũ. Đồng thời cũng rất mỏng v&agrave; vỏ nhựa nhẹ nh&agrave;ng. Mặt trước phủ k&iacute;nh cường lực với phong c&aacute;ch vuốt cong 2.5D thời thượng. C&aacute;c g&oacute;c cạnh được bo cong cầm nắm dễ d&agrave;ng.</p>\r\n\r\n<p>M&agrave;n h&igrave;nh si&ecirc;u tr&agrave;n 6.23&quot; FHD+</p>\r\n\r\n<p>OPPO F7 sở hữu m&agrave;n h&igrave;nh LCD 6.23 inch với độ ph&acirc;n giải 2280 x 1080 k&egrave;m tỷ lệ khung h&igrave;nh 19:9 cho trải nghiệm xem phim hay chơi game tuyệt vời hơn. C&ocirc;ng nghệ m&agrave;n h&igrave;nh IPS với độ ph&acirc;n giải đạt Full HD+ sẽ l&agrave;m h&agrave;i l&ograve;ng nhu cầu sử dụng của bạn.</p>', 4500000, NULL, 0, 0, 1, NULL, '2019-08-23 12:37:37', '2019-08-23 12:37:37', NULL],
            [121, 9, 'Cần mua  Galaxy Note 9', NULL, 9, '<p>Thiết kế sang trọng, đẳng cấp</p>\r\n\r\n<p><strong>Samsung Galaxy Note 9</strong>&nbsp;sở hữu thiết kế hợp kim nguy&ecirc;n khối sang trọng kết hợp khung viền kim loại sắc sảo v&agrave; chắc chắn với phong c&aacute;ch thiết kế đa diện. Camera sau ẩn v&agrave;o lưng m&aacute;y cho trải nghiệm ho&agrave;n to&agrave;n mượt m&agrave; v&agrave;&nbsp;v&ocirc; c&ugrave;ng quyến rũ. B&ecirc;n cạnh đ&oacute;,&nbsp;Samsung Galaxy Note 9 mang đến nhiều m&agrave;u sắc nổi bật cho bạn thỏa sức thể hiện phong c&aacute;ch c&aacute; t&iacute;nh từ sắc xanh đại dương mạnh mẽ, m&agrave;u đen huyền b&iacute; thanh lịch hay m&agrave;u đồng &aacute;nh kim thời thượng c&ugrave;ng b&uacute;t S Pen c&ugrave;ng m&agrave;u</p>\r\n\r\n<p>M&agrave;n h&igrave;nh v&ocirc; cực Quad HD+&nbsp;</p>\r\n\r\n<p>Galaxy Note 9 được trang bị m&agrave;n h&igrave;nh Super AMOLED 6.4inch mang đến trải nghiệm thị gi&aacute;c kh&ocirc;ng giới hạn kết hợp độ ph&acirc;n giải Quad HD+ [2K+] tạo n&ecirc;n sự đột ph&aacute; so c&aacute;c d&ograve;ng điện thoại tr&ecirc;n thị trường với m&agrave;n h&igrave;nh gần như chiếm trọn mặt trước. B&ecirc;n cạnh đ&oacute;, bộ cảm biến v&agrave; qu&eacute;t mống mắt được giấu kh&eacute;o l&eacute;o để kh&ocirc;ng cản trở tầm nh&igrave;n tới ưu hơn.&nbsp;</p>', 17660000, NULL, 1, 1, 1, NULL, '2019-08-23 12:35:45', '2019-08-23 13:03:07', NULL],
            [120, 1, 'Bán iPad Pro 11 inch [2018]', 1, NULL, '<p>Thiết kế si&ecirc;u mỏng</p>\r\n\r\n<p><strong>iPad Pro 11 inch [2018] 256GB Wifi</strong>&nbsp;được trang bị phần viền mỏng đều ở cả bốn cạnh, loại bỏ ph&iacute;m home vật l&yacute; truyền thống v&agrave; t&iacute;ch hợp th&ecirc;m c&ocirc;ng nghệ nhận diện khu&ocirc;n mặt Face ID.&nbsp;</p>\r\n\r\n<p>T&iacute;nh năng Face ID</p>\r\n\r\n<p>iPad Pro sẽ nhận khu&ocirc;n mặt của bạn bất kể iPad ở tư thế n&agrave;o. Đ&acirc;y l&agrave; một t&iacute;nh năng quan trọng bởi người d&ugrave;ng thường c&oacute; th&oacute;i quen d&ugrave;ng iPad ở tư thế ngang v&agrave; dọc. C&oacute; Face ID v&agrave; viền m&agrave;n h&igrave;nh mỏng cũng đồng nghĩa Apple bỏ n&uacute;t Home ở tr&ecirc;n iPad Pro để thay bằng điều khiển cử chỉ.&nbsp;</p>\r\n\r\n<p>Cấu h&igrave;nh mạnh mẽ</p>\r\n\r\n<p>Cấu h&igrave;nh tr&ecirc;n iPad Pro được n&acirc;ng cấp để khiến n&oacute; mạnh hơn cả về xử l&yacute; ứng dụng lẫn xử l&yacute; đồ họa. iPad Pro được trang bị chip A12X Bionic tr&ecirc;n c&ocirc;ng nghệ 7nm, chip n&agrave;y c&oacute; tổng cộng 10 tỉ b&oacute;ng b&aacute;n dẫn với 8 nh&acirc;n [4 nh&acirc;n ở hiệu năng cao v&agrave; 4 nh&acirc;n b&igrave;nh thường].&nbsp;</p>', 21000000, NULL, 0, 0, 1, NULL, '2019-08-23 12:32:57', '2019-08-23 12:32:57', NULL],
            [119, 1, 'Bán Điện Thoại iPhone X', 1, NULL, '<p>Thiết kế lạ mắt kh&ocirc;ng n&uacute;t Home cứng</p>\r\n\r\n<p><strong>Điện Thoại iPhone X 64GB</strong>&nbsp;l&agrave; chiếc điện thoại ho&agrave;n to&agrave;n mới của Apple vừa mới ra mắt tuần vừa qua. Tr&ecirc;n cơ bản, iPhone X vẫn c&oacute; những t&iacute;nh năng như những d&ograve;ng iPhone kh&aacute;c nhưng thiết kế b&ecirc;n ngo&agrave;i lạ mắt hơn, kh&ocirc;ng trang bị n&uacute;t Home cứng, viền kim loại sang trọng v&agrave; đặc biệt l&agrave; cụm camera sau được trang bị theo chiều dọc tạo điểm nhấn cho chiếc điện thoại.</p>\r\n\r\n<p>M&agrave;n h&igrave;nh lớn 5.8 inch</p>\r\n\r\n<p>Sở hữu k&iacute;ch thước m&agrave;n h&igrave;nh lớn 5.8 inch với độ ph&acirc;n giải 1125 x 2436 pixels, mật độ điểm ảnh 458 ppi pixel mang đến khả năng hiển thị m&agrave;u sắc ấn tượng, sắc n&eacute;t cho bạn trải nghiệm ở mọi g&oacute;c nh&igrave;n. M&agrave;n h&igrave;nh lược bỏ n&uacute;t Home cứng truyền thống tạo cảm gi&aacute;c lạ mắt v&agrave; tạo nhiều kh&ocirc;ng gian hơn cho người d&ugrave;ng.</p>', 19990000, NULL, 0, 0, 1, NULL, '2019-08-23 12:30:22', '2019-08-23 14:50:27', NULL],
            [118, 1, 'Bán iPhone 6s Plus 32GB', 1, NULL, '<p>Thiết kế sang trọng</p>\r\n\r\n<p><strong>iPhone 6s Plus 32GB</strong>&nbsp;c&oacute; thiết kế nguy&ecirc;n khối, vỏ ngo&agrave;i từ kim loại bền bỉ với độ mỏng chỉ 7.3 mm, bạn c&oacute; thể dễ d&agrave;ng mang theo m&aacute;y b&ecirc;n m&igrave;nh khi di chuyển v&agrave; sử dụng mọi l&uacute;c mọi nơi. Điện thoại c&oacute; 4 m&agrave;u:&nbsp;V&agrave;ng Hồng, V&agrave;ng Đồng, Bạc v&agrave; X&aacute;m, mỗi phi&ecirc;n bản m&agrave;u sắc đều mang đến sự sang trọng v&agrave; thể hiện c&aacute; t&iacute;nh cho người d&ugrave;ng.</p>\r\n\r\n<p>M&agrave;n h&igrave;nh Retina 5.5 inches HD</p>\r\n\r\n<p>iPhone 6S Plus được trang bị m&agrave;n h&igrave;nh Retina 5.5 inch với độ ph&acirc;n giải HD [1080 x 1920] pixels v&agrave; mật độ ảnh 401ppi sẽ mang đến những h&igrave;nh ảnh hiện thị trung thực nhất. M&agrave;n h&igrave;nh được trang bị lớp phủ chống dấu v&acirc;n tay v&agrave; mang đến bạn g&oacute;c nh&igrave;n rộng để bạn thoải m&aacute;i thư gi&atilde;n, giải tr&iacute; với những bộ phim, lướt web,</p>', 8250000, NULL, 0, 0, 1, NULL, '2019-08-23 12:26:21', '2019-08-23 12:26:21', NULL],
            [130, 10, 'Bán Honda SH 125i', 10, NULL, '<p>Biểu tượng của sự đẳng cấp</p>\r\n\r\n<p><strong>Xe M&aacute;y Honda SH 125i Phanh CBS 2019&nbsp;</strong>Kiệt t&aacute;c thiết kế đậm chất ch&acirc;u &Acirc;u được thổi một luồng gi&oacute; mới với việc bổ sung phi&ecirc;n bản đen mờ c&aacute; t&iacute;nh. Th&acirc;n xe với sắc đen mờ nam t&iacute;nh, logo 3D đỏ nổi bật c&ugrave;ng với sự thay đổi m&agrave;u sắc của c&aacute;c chi tiết như tay dắt sau, b&aacute;nh xe, phuộc trước,đem tới h&igrave;nh ảnh tổng thể mạnh mẽ, ph&oacute;ng kho&aacute;ng v&agrave; đẳng cấp.&nbsp;Phi&ecirc;n bản Honda SH 2019 c&oacute; thể xem l&agrave; sự c&acirc;n bằng giữa thiết kế đặc trưng để bất kỳ ai nh&igrave;n cũng c&oacute; thể nhận ra đ&oacute; l&agrave; SH v&agrave; c&ocirc;ng nghệ hiện đại tr&ecirc;n một chiếc xe đời mới.</p>', 80000000, NULL, 0, 0, 1, NULL, '2019-08-23 13:06:37', '2019-08-23 13:06:37', NULL],
            [131, 10, 'Bán Macbook Pro 2017', 10, NULL, '<p>Kiểu d&aacute;ng hiện đại, sang trọng</p>\r\n\r\n<p><strong>Macbook Pro 2017 [13.3 inch] Core i5/128GB</strong>&nbsp;sở hữu thiết kế mỏng v&agrave; nhẹ với m&agrave;n h&igrave;nh LED-backlit IPS LCD, 2560 x 1600 pixels, 13.3 inches l&agrave;m cho h&igrave;nh ảnh hiển thị cực k&igrave; sắc n&eacute;t v&agrave; thực tế. M&aacute;y được tạo n&ecirc;n từ kim loại nguy&ecirc;n khối, tuy nhi&ecirc;n ch&uacute;ng c&ograve;n mỏng v&agrave; nhẹ hơn rất nhiều so với phi&ecirc;n bản cũ với trọng lượng chỉ 1.37kg.</p>\r\n\r\n<p>Hiệu suất cực khủng&nbsp;</p>\r\n\r\n<p>Kh&ocirc;ng chỉ ăn điểm bởi sự sang trọng v&agrave; đẳng cấp, m&agrave; c&ograve;n ăn điểm về bộ vi xử l&yacute; được ẩn chứa b&ecirc;n trong. M&aacute;y được trang bị dual-core Intel Core i5 2.3GHz v&agrave; Turbo Boost up to 3.6GHz. Với RAM 8GB, 128GB SSD v&agrave; card đồ họa Intel Iris Plus Graphics 640 chắc chắn sẽ l&agrave;m v&ocirc; c&ugrave;ng h&agrave;i l&ograve;ng khi sử dụng.</p>', 40000000, NULL, 0, 0, 1, NULL, '2019-08-23 13:09:53', '2019-08-23 13:09:53', NULL],
            [132, 10, 'Bán Thoại Nokia 105 ', 10, NULL, '<p>Thiết kế nhỏ gọn, đẹp mắt</p>\r\n\r\n<p><strong>Điện Thoại Nokia 105 Dual Sim [2019]</strong>&nbsp;c&oacute; thiết kế hiện đại với c&aacute;c đường bo tr&ograve;n độc đ&aacute;o cho bạn dễ d&agrave;ng cầm giữ cũng như bỏ m&aacute;y v&agrave;o t&uacute;i. Kiểu d&aacute;ng thanh lịch, c&aacute; t&iacute;nh v&agrave; năng động cho giới trẻ. Đặc biệt hơn với nhiều m&agrave;u sắc bắt mắt cho bạn dễ d&agrave;ng lựa chọn theo sở th&iacute;ch.</p>\r\n\r\n<p>Chiếc điện thoại Nokia n&agrave;y c&oacute; thể cho v&agrave;o t&uacute;i quần hay t&uacute;i &aacute;o m&agrave; bạn sẽ kh&ocirc;ng cảm thấy kh&oacute; chịu v&igrave; n&oacute;. Đặc biệt độ ho&agrave;n thiện của những chiếc m&aacute;y Nokia lu&ocirc;n được người d&ugrave;ng đ&aacute;ng gi&aacute; rất cao v&agrave; bạn sẽ kh&ocirc;ng cần phải lo lắng v&igrave; c&oacute; lỡ l&agrave;m đ&aacute;nh rơi m&aacute;y.</p>', 354000, NULL, 0, 0, 1, NULL, '2019-08-23 13:12:14', '2019-08-23 13:12:14', NULL],
            [140, 13, 'Bán Yamaha Exciter', 13, NULL, '<p>Thiết kế mới mang phong c&aacute;ch bụi bặm v&agrave; c&aacute; t&iacute;nh</p>\r\n\r\n<p><strong>Xe M&aacute;y Yamaha Exciter 150 Limited - Matt Blue&nbsp;</strong>với m&agrave;u mới ấn tượng thỏa m&atilde;n đam m&ecirc; cho những người h&acirc;m mộ d&ograve;ng xe số thể thao cao cấp. Exciter 150 Limited mới mang phong c&aacute;ch hoang d&atilde; đầy bụi bặm, khẳng định chất ri&ecirc;ng với t&ocirc;ng m&agrave;u nhạt hơn nhưng vẫn đậm nam t&iacute;nh nhờ c&aacute;ch phối m&agrave;u kh&eacute;o l&eacute;o v&agrave; logo thiết kế tinh tế. Phi&ecirc;n bản mới n&agrave;y đi theo xu hướng phong c&aacute;ch đang thịnh h&agrave;nh mang lại vẻ đẹp ph&oacute;ng kho&aacute;ng, hứa hẹn sẽ tiếp tục tạo n&ecirc;n cơn sốt cho c&aacute;c fan của Exciter 150.</p>', 25000000, NULL, 1, 0, 1, NULL, '2019-08-23 14:54:29', '2019-08-23 14:54:29', NULL],
            [133, 10, 'Cần mua Tivi Samsung 43 ', NULL, 10, '<p>Kiểu d&aacute;ng hiện đại, tinh tế</p>\r\n\r\n<p><strong>Smart Tivi Samsung 43 inch UHD 4K UA43NU7100KXXV</strong>&nbsp;c&oacute; thiết kế tinh tế v&agrave; hiện đại với m&agrave;n h&igrave;nh mỏng tinh tế, to&aacute;t l&ecirc;n vẻ đẹp sang trọng nhưng hiện đại, h&agrave;i h&ograve;a với bất kỳ kh&ocirc;ng gian n&agrave;o trong căn ph&ograve;ng nh&agrave; bạn. 3 cạnh viền si&ecirc;u mỏng gi&uacute;p mắt tập trung v&agrave;o từng chi tiết trong mọi khung h&igrave;nh, mang đến trải nghiệm bao tr&ugrave;m mọi gi&aacute;c quan.</p>', 5000000, NULL, 0, 1, 1, NULL, '2019-08-23 13:14:13', '2019-08-23 13:14:13', NULL],
            [134, 10, 'Cần bán Tivi OLED Sony 4K', 10, NULL, '<p>Thiết kế m&agrave;n h&igrave;nh OLED si&ecirc;u mỏng, đẳng cấp</p>\r\n\r\n<p><strong>Android Tivi OLED Sony 4K 65 inch KD-65A8G</strong>&nbsp;với thiết kế m&agrave;n h&igrave;nh to tr&agrave;n viền khiến tivi kh&ocirc;ng chỉ l&agrave; một thiết bị giải tr&iacute; nữa m&agrave; c&ograve;n l&agrave; một điểm nhấn nội thất đắt gi&aacute; cho ng&ocirc;i nh&agrave; bạn. M&agrave;n h&igrave;nh tivi lớn 65 inch th&iacute;ch hợp để bạn đặt ở ph&ograve;ng kh&aacute;ch, treo tường ở ph&ograve;ng họp, mang đến vẻ đẹp thanh lịch cho gian ph&ograve;ng.</p>', 60000000, NULL, 0, 0, 1, NULL, '2019-08-23 13:15:55', '2019-08-23 13:15:55', NULL],
            [135, 10, 'Bán Hồ Nam Điện Tử ', 10, NULL, '<p>Phi&ecirc;n bản mới n&acirc;ng cấp mới của mẫu&nbsp;đồng hồ điện tử&nbsp;Skmei 1155 hot nhất năm 2018 của h&atilde;ng đồng hồ điện tử SKMEI. Với phi&ecirc;n bản mới g&oacute;c cạnh hơn - man lỳ nam t&iacute;nh hơn.&nbsp;Với k&iacute;ch thước mặt kh&aacute; lớn đến 52mm sản phẩm chỉ ph&ugrave; hợp với bạn Nam c&oacute; k&iacute;ch cỡ trung b&igrave;nh to kh&ocirc;ng ph&ugrave; hợp với bạn nam tay nhỏ nh&eacute;!</p>', 1500000, NULL, 0, 0, 1, NULL, '2019-08-23 13:19:05', '2019-08-23 13:19:05', NULL],
            [136, 10, 'Bán áo sơ mi nam', 10, NULL, '<ul>\r\n	<li><strong>&Aacute;o Sơ Mi Nam Form Rộng Kẻ Caro&nbsp;</strong>lu&ocirc;n l&agrave; sự lựa chọn h&agrave;ng đầu của giới c&ocirc;ng sở hiện nay, với kiểu d&aacute;ng lịch thiệp, đường may đẹp v&agrave; chất lượng vải cao cấp.</li>\r\n	<li>&Aacute;o sơ mi gi&uacute;p bạn nam tr&ocirc;ng lịch l&atilde;m v&agrave; sang trọng hơn với thiết kế sang trọng, gia c&ocirc;ng sắc sảo.</li>\r\n	<li>&Aacute;o form rộng, trẻ trung, tay d&agrave;i năng động.</li>\r\n	<li>Sản phẩm may từ chất liệu vải th&ocirc; nhập khẩu cao cấp, được biết đến với đặc t&iacute;nh thấm h&uacute;t mồ h&ocirc;i tốt, tho&aacute;ng m&aacute;t ngay cả trong điều kiện thời thiết n&oacute;ng bức cho form &aacute;o đứng, sang trọng.</li>\r\n	<li>Bề mặt vải mềm mịn. Vải c&ograve;n c&oacute; đặc t&iacute;nh chống b&aacute;m bẩn v&agrave; chống m&agrave;i m&ograve;n tốt, đảm bảo sự bền đẹp với thời gian, dễ giặt, nhanh kh&ocirc;.</li>\r\n	<li>Bạn c&oacute; thể kết hợp c&ugrave;ng quần t&acirc;y, jeans, kaki cho phong c&aacute;ch thời trang đa dạng.</li>\r\n</ul>', 150000, NULL, 0, 0, 1, NULL, '2019-08-23 13:25:41', '2019-08-23 13:25:41', NULL],
            [137, 10, 'bán tủ lạnh', 10, NULL, '<ul>\r\n	<li>L&ograve;ng tủ th&eacute;p phẳng sơn tĩnh điện l&agrave;m lạnh nhanh ch&oacute;ng</li>\r\n	<li>Th&acirc;n tủ phủ tole th&eacute;p d&agrave;y 0,4mm</li>\r\n	<li>B&aacute;nh xe chịu lực di chuyển dễ d&agrave;ng</li>\r\n	<li>Cửa tủ k&egrave;m kh&oacute;a an to&agrave;n</li>\r\n	<li>Điều chỉnh nhiệt độ b&ecirc;n ngo&agrave;i Mechanical</li>\r\n	<li>D&agrave;n lạnh đồng nguy&ecirc;n chất si&ecirc;u bền</li>\r\n	<li>Gas R600a tiết kiệm điện v&agrave; bảo vệ m&ocirc;i trường</li>\r\n</ul>', 5000000, NULL, 0, 0, 1, NULL, '2019-08-23 13:27:46', '2019-08-23 13:27:46', NULL],
            [138, 13, 'bán GALAXY Y S5360', 13, NULL, '<ul>\r\n	<li>Chỉ v&agrave;i trăm ngh&igrave;n m&agrave; qu&yacute; kh&aacute;ch đ&atilde; c&oacute; trong tay một sản phẩm&nbsp;<strong>SAMSUNG GALAXY Y S5360</strong></li>\r\n	<li>T&ecirc;n sản phẩm&nbsp;h&agrave;ng ch&iacute;nh h&atilde;ng của&nbsp;<strong>SAMSUNG</strong>.&nbsp;Lắp sim l&agrave; c&oacute; thể sử dụng được ngay</li>\r\n	<li>M&aacute;y mới cực đẹp</li>\r\n	<li>M&aacute;y mua về l&agrave; c&oacute; thể sử dụng. M&aacute;y sử dụng được c&aacute;c chứng năng cơ bản như youtube, facebook, zing mp3,...</li>\r\n	<li>Tại ứng dụng theo y&ecirc;u cầu.</li>\r\n	<li>Ph&ugrave; hợp l&agrave;m qu&agrave; tặng, m&aacute;y phụ, m&aacute;y li&ecirc;n lạc, xem phim nghe nhạc hay giải tr&iacute;.</li>\r\n</ul>', 600000, NULL, 1, 0, 1, NULL, '2019-08-23 14:38:49', '2019-08-23 14:38:49', NULL],
            [139, 13, 'Cần mua xe đạp', NULL, 13, '<p>Vẫn mang đậm thiết kế của&nbsp;những bản trước, với&nbsp;thiết kế đơn giản 1 đĩa 1 l&iacute;p phục vụ cho việc đi lại hoặc đi dạo nhẹ nh&agrave;ng. Khung th&eacute;p cường lực c&ocirc;ng nghệ của Giant cực kỳ chắc chắn. Chắn b&ugrave;n sắt sơn tĩnh điện sạch sẽ ho&agrave;n to&agrave;n. Baga sau bằng th&eacute;p chịu tải trọng một người lớn.&nbsp;<em>Giant Ineed Master</em>&nbsp;sẽ gi&uacute;p bạn di chuyển dễ d&agrave;ng trong th&agrave;nh phố.</p>', 460000, NULL, 1, 1, 1, NULL, '2019-08-23 14:47:09', '2019-08-23 14:47:09', NULL],
            [141, 13, 'bán Tai nghe chụp', 13, NULL, '<p><br />\r\nD&acirc;y cực kỳ chắc chắn, chống đứt chống rối với c&ocirc;ng nghệ bọc 2 lớp<br />\r\nMicrophone l&agrave; ống dẫn &acirc;m ho&agrave;n to&agrave;n bằng cao su kh&ocirc;ng bị g&atilde;y<br />\r\nN&uacute;t chỉnh &acirc;m lượng tr&ecirc;n th&acirc;n tai<br />\r\nD&ugrave;ng cho ph&ograve;ng net cực tốt v&agrave; bền bỉ<br />\r\nKiểu d&aacute;ng game thủ bắt mắt<br />\r\nNghe cực &ecirc;m tai v&agrave; thoải m&aacute;i</p>', 150000, NULL, 1, 0, 1, NULL, '2019-08-23 14:58:32', '2019-08-23 14:58:32', NULL],
            [142, 13, 'Bán áo da nam', 13, NULL, '<p>&nbsp;* Chất Liệu : Da Nhập cao cấp -&nbsp;<strong>l&oacute;t l&ocirc;ng cừu lớp b&ecirc;n trong</strong><br />\r\n&nbsp; &nbsp; &nbsp;* Kiểu D&aacute;ng : D&agrave;i tay - Y h&igrave;nh<br />\r\n&nbsp; &nbsp; &nbsp;* M&agrave;u Sắc : như H&igrave;nh<br />\r\n&nbsp; &nbsp; &nbsp;* K&iacute;ch Thước :&nbsp;<strong>Size M : 48-58kg, &nbsp;L: 59-68kg, XL: 69-75kg</strong>&nbsp;&nbsp;[ t&ugrave;y chiều cao].<br />\r\n&nbsp; &nbsp; &nbsp;* Xuất Xứ : Việt Nam</p>', 250000, NULL, 0, 0, 1, NULL, '2019-08-23 15:02:32', '2019-08-23 15:02:32', NULL],
            [143, 13, 'bán Áo khoác da', 13, NULL, '<p><strong>&Aacute;o kho&aacute;c da l&oacute;t l&ocirc;ng nam thời trang cao cấp AD75NAU</strong></p>\r\n\r\n<p>Đặc điểm nổi bật: &Aacute;o kho&aacute;c da l&oacute;t l&ocirc;ng nam thời trang cao cấp AD75NAU</p>\r\n\r\n<p>&Aacute;o kho&aacute;c da nam l&oacute;t l&ocirc;ng thời trang cao cấp với gam m&agrave;u đen nam t&iacute;nh, mạnh mẽ, phong c&aacute;ch cực chất cho c&aacute;c ch&agrave;ng.</p>\r\n\r\n<p>Kiểu &aacute;o d&agrave;i tay, kh&oacute;a k&eacute;o ở cổ tay, cổ trụ cao c&ugrave;ng với đường cắt may tinh tế. Mặt trước c&oacute; 2 t&uacute;i kh&oacute;a k&eacute;o b&ecirc;n h&ocirc;ng rất tiện dụng, bo tay, viền bằng vải dệt kim cao cấp.</p>\r\n\r\n<p>Chất liệu da PU cao cấp đảm bảo kh&ocirc;ng bong tr&oacute;c, kh&ocirc;ng nhăn, kh&ocirc;ng g&atilde;y đổ k&egrave;m l&oacute;t l&ocirc;ng b&ecirc;n trong tạo sự &ecirc;m dịu v&agrave; ấm &aacute;p khi mặc.</p>', 600000, NULL, 1, 0, 1, NULL, '2019-08-23 15:04:17', '2019-08-23 15:04:17', NULL],
            [144, 12, 'Cần mua Giày nam', NULL, 12, '<h3>Đế đ&uacute;c nguy&ecirc;n kh&ocirc;i, được kh&acirc;u chỉ gai chắc chắc, đi mềm v&agrave; &ecirc;m ch&acirc;n.<br />\r\nChất liệu da mềm mại, tho&aacute;ng kh&iacute; tốt, chống h&ocirc;i ch&acirc;n.<br />\r\nFom d&aacute;ng &ocirc;m ch&acirc;n kh&ocirc;ng b&egrave; ngang.<br />\r\nL&oacute;t m&agrave;nh , tho&aacute;ng kh&iacute; kh&ocirc;ng h&ocirc;i ch&acirc;n .<br />\r\nTh&iacute;ch hợp đi l&agrave;m đi chơi đều rất đẹp</h3>', 250000, NULL, 0, 1, 1, NULL, '2019-08-23 15:33:25', '2019-08-23 15:33:25', NULL],
            [145, 12, 'Bán dụng cụ tập cổ tay', 12, NULL, '<h1><em><strong>dụng cụ tập cổ tay - dụng cụ tập tay</strong></em></h1>\r\n\r\n<h1><em><strong>dụng cụ tập tay - Dụng cụ tập tay - dụng cụ thể thao - thể dục, gym&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></em></h1>\r\n\r\n<h1><em><strong>Dụng Cụ Tập Bắp Cổ Tay L&oacute;t Đệm</strong></em></h1>', 250000, NULL, 0, 0, 1, NULL, '2019-08-23 15:36:12', '2019-08-23 15:36:12', NULL],
            [146, 12, 'Bán ĐÀN UKULELE', 12, NULL, '<p><strong><em>*TẶNG</em></strong></p>\r\n\r\n<p><strong><em>+ S&aacute;ch hướng dẫn</em></strong></p>\r\n\r\n<p><strong><em>+ Ph&iacute;m gảy</em></strong></p>\r\n\r\n<p><strong><em>+ Hộp chống sốc</em></strong></p>\r\n\r\n<p><strong><em>+ voucher giảm gi&aacute; 5% cho lần mua c&aacute;c sản phẩm kh&aacute;c tại shop</em></strong></p>\r\n\r\n<p><strong><em>+ Giảm 30k tiền ship cho đơn từ 200k.</em></strong></p>\r\n\r\n<p><strong><em>+ Bảo h&agrave;nh 6 th&aacute;ng</em></strong></p>', 670000, NULL, 0, 0, 1, NULL, '2019-08-23 15:54:42', '2019-08-23 15:54:42', NULL],
            [147, 12, 'cần mua Nokia E72', NULL, 12, '<ul>\r\n	<li><strong>Bảo h&agrave;nh:</strong>&nbsp;12 th&aacute;ng.</li>\r\n	<li><strong>H&atilde;ng sản xuất:</strong>&nbsp;Nokia.</li>\r\n	<li><strong>Loại cổng sạc:</strong>&nbsp;Kh&aacute;c.</li>\r\n	<li><strong>Số SIM:</strong>&nbsp;1 SIM.</li>\r\n	<li><strong>Kết nối mạng:</strong>&nbsp;2G, 3G, Wifi.</li>\r\n	<li><strong>T&iacute;nh năng nổi trội:</strong>&nbsp;Chống va đập, D&agrave;nh cho người gi&agrave;.</li>\r\n</ul>', 852000, NULL, 1, 1, 1, NULL, '2019-08-23 15:57:02', '2019-08-23 15:57:02', NULL],
            [148, 12, 'Bán HDMI sang VGA', 12, NULL, '<p>&nbsp;Thiết kế si&ecirc;u nhỏ gọn tiện lợi cho người d&ugrave;ng</p>\r\n\r\n<p>- Hỗ trợ chuyển đổi từ cổng HDMI sang VGA</p>\r\n\r\n<p>- Hỗ trợ độ ph&acirc;n giải 1080p sắc n&eacute;t, độ ph&acirc;n giải cao</p>\r\n\r\n<p>- Chuyển đổi t&iacute;n hiệu kĩ thuật số sang t&iacute;n hiệu Analog</p>\r\n\r\n<p>- Gi&uacute;p bạn xuất h&igrave;nh ảnh ph&oacute;ng đại từ m&aacute;y t&iacute;nh, tivi box sang m&agrave;n h&igrave;nh TV, m&agrave;n h&igrave;nh LCD v&agrave; m&aacute;y chiếu</p>\r\n\r\n<p>- Kh&ocirc;ng cần lắp đặt dễ d&agrave;ng sử dụng</p>', 250000, NULL, 1, 0, 1, NULL, '2019-08-23 15:59:11', '2019-08-23 15:59:11', NULL],
            [149, 12, 'bán cáp OTG iphone', 12, NULL, '<p>THUỘC T&Iacute;NH SẢN PHẨM</p>\r\n\r\n<ul>\r\n	<li><strong>Bảo h&agrave;nh:</strong>&nbsp;1 th&aacute;ng.</li>\r\n	<li><strong>Độ d&agrave;i d&acirc;y:</strong>&nbsp;Dưới 1 m&eacute;t.</li>\r\n	<li><strong>H&atilde;ng sản xuất:</strong>&nbsp;KH&Aacute;C.</li>\r\n	<li><strong>Loại c&aacute;p:</strong>&nbsp;C&aacute;c loại c&aacute;p kh&aacute;c.</li>\r\n	<li><strong>Phương thức bảo h&agrave;nh:</strong>&nbsp;Bằng tem bảo h&agrave;nh.</li>\r\n</ul>', 140000, NULL, 0, 0, 1, NULL, '2019-08-23 16:00:58', '2019-08-23 16:00:58', NULL],
            [150, 12, 'Cần mua Chân Váy', NULL, 12, '<p><strong>Thương hiệu thời trang thiết kế DE LEAH</strong>&nbsp;- thiết kế v&agrave; b&aacute;n sẵn c&aacute;c sản phẩm thời trang nữ cao cấp. Sản phẩm thiết kế của thương hiệu De Leah sẽ gi&uacute;p bạn trở n&ecirc;n sang trọng, thanh lịch v&agrave; tinh tế.</p>\r\n\r\n<p>C&aacute;c sản phẩm đảm bảo chuẩn ảnh 100% kh&ocirc;ng qua chỉnh sửa. Chất lượng chuẩn đến từng đường kim mũi chỉ, với mẫu m&atilde; đa dạng, tinh tế v&agrave; hợp thời trang. Rất mong nhận được phản hồi t&iacute;nh cực từ ph&iacute;a kh&aacute;ch h&agrave;ng y&ecirc;u qu&yacute;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Ch&acirc;n v&aacute;y &ocirc;m can lưới</em></strong></p>\r\n\r\n<p>Ch&acirc;n v&aacute;y &ocirc;m can lưới, xẻ vạt 2 b&ecirc;n trẻ trung, nữ t&iacute;nh cho người mặc. Ch&acirc;n v&aacute;y d&aacute;ng &ocirc;m vừa t&ocirc;n d&aacute;ng v&agrave; dễ ph&ugrave; hợp với nhiều d&aacute;ng người, dễ phối với c&aacute;c loại trang phục. Ch&acirc;n v&aacute;y c&oacute; thể mặc dạo phố hoặc c&ocirc;ng sở.</p>', 250000, NULL, 1, 1, 1, NULL, '2019-08-23 16:02:47', '2019-08-23 16:02:47', NULL],
            [151, 12, 'Cần mua chân váy xòe', NULL, 12, '<ul>\r\n	<li><strong>Giảm gi&aacute; khi mua tr&ecirc;n điện thoại</strong></li>\r\n	<li><strong>Hỗ trợ ph&iacute; vận chuyển cũng như freeship cho đơn h&agrave;ng tr&ecirc;n 149k</strong></li>\r\n	<li><strong>Tặng điểm sen khi đ&aacute;nh gi&aacute; tốt[điểm sen c&oacute; thể d&ugrave;ng mua h&agrave;ng cho lần sau]</strong></li>\r\n	<li><strong>Được kiểm tra h&agrave;ng trước khi thanh to&aacute;n n&ecirc;n c&aacute;c bạn y&ecirc;n t&acirc;m mua h&agrave;ng của shop nha!</strong></li>\r\n	<li><strong>Giao h&agrave;ng tận nh&agrave; v&agrave; nhiều ưu đ&atilde;i kh&aacute;c nữa&hellip;</strong></li>\r\n	<li><strong>Mọi chi tiết vui l&ograve;ng li&ecirc;n hệ sdt 0965027728[zalo,facebook]để được tư vấn miễn ph&iacute;.</strong></li>\r\n</ul>\r\n\r\n<p>Ch&uacute;c qu&yacute; kh&aacute;ch online vui vẻ!</p>', 600000, NULL, 1, 1, 1, NULL, '2019-08-23 16:05:30', '2019-08-23 16:05:30', NULL],
            [152, 12, 'cần mua Hoodie BTS', NULL, 12, '<p>* Th&ocirc;ng số sản phẩm&nbsp;<em><strong>Hoodie BTS Love Yourself Tay Lỡ&nbsp;</strong></em>:</p>\r\n\r\n<p>&nbsp;- &Aacute;o Hoodie cộc tay</p>\r\n\r\n<p>&nbsp;- Chất liệu vải cotton co d&atilde;n,thấm h&uacute;t mồ h&ocirc;i cực tốt.</p>\r\n\r\n<p>&nbsp;- H&igrave;nh in thấm m&agrave;u,&nbsp;<strong>BẢO H&Agrave;NH VĨNH VIỄN</strong>&nbsp; kh&ocirc;ng bao giờ phai.</p>\r\n\r\n<p>&nbsp;- Kh&aacute;ch h&agrave;ng chọn size &aacute;o tương đối theo như bảng size sau :</p>', 250000, NULL, 1, 1, 1, NULL, '2019-08-23 16:07:41', '2019-08-23 16:07:41', NULL],
            [153, 12, 'cần mua ÁO', NULL, 12, '<p>Chất liệu thun voan mềm mịn<br />\r\nCho bạn cảm gi&aacute;c mềm mại, thoải m&aacute;i<br />\r\nThiết kế &aacute;o tay ngắn,&nbsp; v&ocirc; c&ugrave;ng duy&ecirc;n d&aacute;ng, trẻ trung<br />\r\nForm d&aacute;ng cực chuẩn ph&ugrave; hợp với nhiều d&aacute;ng người, nhiều lứa tuổi<br />\r\nM&agrave;u sắc : xanh dương<br />\r\nC&oacute; thể mặc ở nh&agrave;, dạo phố,<br />\r\nfree size dưới 55kg t&ugrave;y chiều cao</p>', 630000, NULL, 0, 1, 1, NULL, '2019-08-23 16:09:29', '2019-08-23 16:09:29', NULL],
            [154, 11, 'Bán ÁO NGỰC BIG SIZE', 11, NULL, '<p><strong><em>&Aacute;o ngực big size:&nbsp;</em></strong>C&oacute; gọng, ko m&uacute;t, ko độn. &Aacute;o chỉ c&oacute; lớp foam mỏng.</p>\r\n\r\n<p><em><strong>&Aacute;o ngực big size&nbsp;</strong></em>ch&iacute;nh h&atilde;ng la senza. C&oacute; ảnh do shop tự chụp. Cam kết h&agrave;ng đ&uacute;ng h&atilde;ng, cam kết ch&iacute;nh h&atilde;ng</p>\r\n\r\n<p><em><strong>&Aacute;o ngực big size</strong></em>&nbsp;&aacute;o c&oacute; m&oacute;c nhẹ ở cup vải n&ecirc;n gi&aacute; shop SALE KỊCH S&Agrave;N ạ</p>\r\n\r\n<p>Đơn gi&aacute;: 1 &aacute;o [ ko k &egrave;m quần hay phụ kiện chụp c&ugrave;ng</p>\r\n\r\n<p>Mời anh chị xem bảng quy đổi size của h&atilde;ng để x&aacute;c định hoặc chat với shop để được tư vấn.</p>\r\n\r\n<p>Ảnh do shop tự chụp, cam kết sản phẩm như h&igrave;nh ảnh, chuẩn auth</p>\r\n\r\n<p>Mời anh chị xem th&ecirc;m cac sản phẩm<a href=\"https://www.sendo.vn/shop/sexyshop/thoi-trang-nu/thoi-trang-big-size/\">&nbsp;<em><strong>&aacute;o l&oacute;t big size</strong>&nbsp;</em>của shop tại đ&acirc;y</a></p>', 150000, NULL, 0, 0, 1, NULL, '2019-08-23 16:20:54', '2019-08-23 16:20:54', NULL],
            [155, 11, 'Bán sandal nữ', 11, NULL, '<h1>Gi&agrave;y sandal nữ</h1>\r\n\r\n<p>Trẻ trung, s&agrave;nh điệu l&agrave; những g&igrave; m&agrave; kiểu d&aacute;ng mới mẻ của mẫu&nbsp;<em><strong>d&eacute;p sandal nữ</strong></em>&nbsp;đế xuồng đem lại cho ph&aacute;i nữ. Với thiết kế quai ngang mặt s&acirc;n v&agrave; quai &ocirc;m ngang mu b&agrave;n ch&acirc;n tạo sự chắc chắn cho b&agrave;n ch&acirc;n ph&aacute;i nữ trong khi di chuyển. Gi&agrave;y sandal nữ với phần quai sau được l&agrave;m từ vải thun co d&atilde;n tốt tạo sự thoải m&aacute;i cho bạn nữ, ph&ugrave; hợp với nhiều k&iacute;ch cỡ ch&acirc;n. Đế cao vừa phải 3cm với r&atilde;nh chống trượt gi&uacute;p dễ d&agrave;ng di chuyển tr&ecirc;n mọi địa h&igrave;nh. Với gam m&agrave;u đơn giản nhưng hiện đại, trẻ trung gi&agrave;y sandal nữ đế xuồng ph&ugrave; hợp với mọi trang phục ph&aacute;i nữ.</p>', 120000, NULL, 0, 0, 1, NULL, '2019-08-23 16:22:55', '2019-08-23 16:22:55', NULL],
            [156, 11, 'bán cây Mai chiếu thủy', 11, NULL, '<p><strong>&nbsp;Mai chiếu thủy l&aacute; kim</strong></p>\r\n\r\n<p>Hay c&ograve;n gọi l&agrave; kim gi&ograve;n, kim thanh mai, kim l&aacute; tứ, kim đu&ocirc;i chồn, l&aacute; tứ x&ugrave;. [Hiện nay rất nhiều người hay nhầm c&acirc;y thanh mai v&agrave; c&acirc;y kim thanh mai: Loại kim thanh mai đ&uacute;ng l&aacute; chỉ to hơn hạt tấm 1 ch&uacute;t th&acirc;n x&ugrave; x&igrave;, thường kh&ocirc;ng c&oacute; gốc to, tại dưới gốc mọc rất nhiều mầm con.</p>\r\n\r\n<p>Mai chiếu thủy l&agrave; những lo&agrave;i c&acirc;y được ưa chuộng v&igrave; đặc t&iacute;nh sinh học của ch&uacute;ng l&agrave; dễ trồng dễ chăm s&oacute;c. Mặt kh&aacute;c Mai chiếu thủy c&oacute; thể ra hoa thường xuy&ecirc;n, c&acirc;y c&oacute; hoa tạo ra m&ugrave;i hương thơm ng&agrave;o ngạt dễ quyến rũ l&ograve;ng người.</p>\r\n\r\n<p>Mai chiếu thủy c&oacute; nguồn gốc từ miền&nbsp;&ETH;&ocirc;ng&nbsp;Dương, thường trồng chủ yếu l&agrave;m cảnh,&nbsp;bonsai, c&acirc;y cảnh trang tr&iacute; s&acirc;n vườn&hellip;&nbsp;mai chiếu thủy&nbsp;biểu trưng cho sự bền vững v&agrave; ổn định của gia đ&igrave;nh.</p>', 250000, NULL, 1, 0, 1, NULL, '2019-08-23 16:24:55', '2019-08-23 16:24:55', NULL],
            [157, 11, 'Bán Máy Bay Điều Khiển', 11, NULL, '<p>M&aacute;y bay điều khiển từ xa No.901 l&agrave; sản phẩm đồ chơi gi&aacute; rẻ nhưng rất được ưa chuộng tại c&aacute;c nước Ch&acirc;u &Acirc;u như Anh v&agrave; T&acirc;y Ban Nha. Với những t&iacute;nh năng như chống chịu va đập, thời gian bay 5-8 ph&uacute;t, No.901 ch&iacute;nh l&agrave; sản phẩm m&aacute;y bay điều khiển từ xa gi&aacute; rẻ tốt nhất.<br />\r\n&nbsp;</p>', 250000, NULL, 0, 0, 1, NULL, '2019-08-23 16:31:50', '2019-08-23 16:31:50', NULL],
            [158, 11, 'bán Mô tô điều khiển', 11, NULL, '<p>THUỘC T&Iacute;NH SẢN PHẨM</p>\r\n\r\n<ul>\r\n	<li><strong>Chất liệu:</strong>&nbsp;Nhựa, Cao su, Kim loại, Kh&aacute;c.</li>\r\n	<li><strong>Độ tuổi:</strong>&nbsp;Sơ sinh đến 2 tuổi, 2 đến 4 tuổi, 5 đến 7 tuổi, 8 đến 13 tuổi, 14 tuổi trở l&ecirc;n.</li>\r\n	<li><strong>Bảo h&agrave;nh:</strong>&nbsp;bảo h&agrave;nh 30 ng&agrave;y.</li>\r\n	<li><strong>Xuất xứ:</strong>&nbsp;Trung Quốc.</li>\r\n</ul>', 360000, NULL, 0, 0, 1, NULL, '2019-08-23 16:33:57', '2019-08-23 16:33:57', NULL],
            [159, 11, 'Bán Xe đạp địa hình', 11, NULL, '<table cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Thương hiệu</td>\r\n			<td><a href=\"http://tiki.vn/thuong-hieu/giant.html?_lc=Vk4wMzQwMjkwMTA%3D\">Giant</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Xuất xứ thương hiệu</td>\r\n			<td>Đ&agrave;i Loan</td>\r\n		</tr>\r\n		<tr>\r\n			<td>K&iacute;ch thước</td>\r\n			<td>\r\n			<p>150x20x70</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>SKU</td>\r\n			<td>5852088050904</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Model</td>\r\n			<td>GIANT_2019_ESCAPE_CITY2</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Lưu &yacute;</td>\r\n			<td>Sản phẩm được giao nguy&ecirc;n đai nguy&ecirc;n kiện v&agrave; chưa được lắp ho&agrave;n chỉnh [Kh&aacute;ch h&agrave;ng cần lắp b&aacute;nh trước, ghi đ&ocirc;ng, b&agrave;n đạp v&agrave; giỏ xe]</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 9600000, NULL, 0, 0, 1, NULL, '2019-08-23 16:36:15', '2019-08-23 16:36:15', NULL],
            [160, 11, 'Bán xe Giant 133DS', 11, NULL, '<p>Thiết kế độc đ&aacute;o</p>\r\n\r\n<p><strong>Xe M&aacute;y Điện Giant 133DS</strong>&nbsp;c&oacute; kiểu d&aacute;ng mạnh mẽ, độc đ&aacute;o. B&aacute;nh trước được thiết kế với v&agrave;nh đ&uacute;c hợp kim c&oacute; độ bền cao, khỏe mạnh, gi&uacute;p chiếc xe dễ d&agrave;ng di chuyển qua mọi địa h&igrave;nh.</p>\r\n\r\n<p>Cụm đ&egrave;n pha ph&iacute;a trước đẹp mắt</p>\r\n\r\n<p>Xe m&aacute;y điện sử dụng đ&egrave;n pha được thiết kế độc đ&aacute;o, với phong c&aacute;ch hai đ&egrave;n hiện đại, c&oacute; thể hoạt động ở hai chế độ chiếu s&aacute;ng v&agrave; khản năng chiếu s&aacute;ng tr&ecirc;n 100m trong điều kiện &aacute;nh s&aacute;ng yếu.</p>', 9800000, NULL, 0, 0, 1, NULL, '2019-08-23 16:37:54', '2019-08-23 16:37:54', NULL],
            [161, 11, 'Bán Xe Máy Điện Nioshima', 11, NULL, '<p>Thiết kế cổ điển sang trọng</p>\r\n\r\n<p><strong>Xe Điện Nioshima Vespa Nagaki</strong>&nbsp;c&oacute; thiết kế cổ điển độc đ&aacute;o với những đường cong mềm mại nữ t&iacute;nh. L&agrave; một chiếc xe m&aacute;y điện, Vespa Nagaki c&oacute; yếm to, chỗ để chận rộng gi&uacute;p tr&aacute;nh bắn bẩn. Xe kh&aacute; cao gi&uacute;p t&ocirc;n d&aacute;ng người điều khiển. Tay ga được thiết kế thanh tho&aacute;t, c&aacute;c n&uacute;t điều khiển được đặt vị tr&iacute; hợp l&yacute; v&ocirc; c&ugrave;ng thuận tiện cho người d&ugrave;ng.</p>\r\n\r\n<p>Động cơ mạnh mẽ</p>\r\n\r\n<p>Xe điện Vespa Nagaki l&agrave; mẫu xe c&ocirc;ng nghệ cao được trang bị động cơ mạnh mẽ với c&ocirc;ng suất l&ecirc;n đến 1000w, sử dụng 5 b&igrave;nh ắc quy 20A gi&uacute;p xe di chuyển nhanh hơn, tốc độ tối đa m&agrave; xe c&oacute; thể đạt được l&agrave; 60km/h, qu&atilde;ng đường đi được trong một lần sạc đạt đầy đạt 60 - 80km.</p>\r\n\r\n<p>Hệ thống phanh đĩa an to&agrave;n</p>\r\n\r\n<p>Phanh đĩa trước được trang bị hệ thống phanh đĩa, kết hợp phanh k&eacute;o sau tạo lực dẫn động đầu phanh lớn, an to&agrave;n hơn khi người điều khiển dừng xe đột xuất. B&ecirc;n cạnh đ&oacute;, hệ thống giảm x&oacute;c phuộc dầu nh&iacute;n, v&agrave; giảm x&oacute;c l&ograve; xo &ecirc;m &aacute;i, ch&igrave;a kh&oacute;a đa năng, hệ thống b&aacute;o chống trộm hiệu quả&hellip;</p>', 5000000, NULL, 0, 0, 1, NULL, '2019-08-23 16:39:54', '2019-08-23 16:39:54', NULL],
            [162, 11, 'Bán Ốp chìa khóa', 11, NULL, '<p>Ốp ch&igrave;a kh&oacute;a carbon, c&aacute;c bon cao cấp, bọc, bảo vệ ch&igrave;a kh&oacute;a k&egrave;m m&oacute;c đeo inox cho xe Hyundai &nbsp; Santa Fe, Accent, Kona,&hellip;mẫu mới b&ecirc;n trong bọc cao su mềm, tr&aacute;nh va đập, bảo vệ ch&igrave;a kh&oacute;a cực tốt. Chất liệu sử dụng nhựa ABS v&acirc;n carbon cao cấp. T&aacute;c dụng bảo vệ ch&igrave;a kh&oacute;a xe tr&aacute;nh rơi, va chạm m&agrave; c&aacute;c chức năng của ch&igrave;a vẫn sử dụng b&igrave;nh thường. Sản phẩm c&oacute; nhiều m&agrave;u, được đựng trong hộp [c&oacute; tua v&iacute;t th&aacute;o lắp đi k&egrave;m], dễ d&agrave;ng th&aacute;p lắp, sử dụng.</p>', 250000, NULL, 0, 0, 1, NULL, '2019-08-23 16:44:29', '2019-08-23 16:44:29', NULL],
            [163, 11, 'Bán Bạt phủ Xe Ô tô', 11, NULL, '<h2>Bạt phủ Xe &Ocirc; t&ocirc;, Xe hơi tr&aacute;ng nh&ocirc;m cao cấp STARCAR &ndash; Size YXXL d&ugrave;ng cho xe 7 chỗ Toyota Prado, Ford Everest, Hyundai Santafe ...v.v. L&agrave; loại bạt chuy&ecirc;n dụng để chống n&oacute;ng cho xe, n&oacute; bao phủ to&agrave;n bộ phần mui xe, cửa k&iacute;nh, th&acirc;n xe, những nơi phải tiếp nhận nhiều &aacute;nh nắng mặt trời v&agrave; dễ d&agrave;ng hấp thụ nhiệt nhất.Bạt phủ xe tr&aacute;ng nh&ocirc;m c&oacute; thiết kế th&ocirc;ng minh, c&oacute; đầy đủ t&aacute;c dụng chống nắng, chống bụi, chống sương, chống trầy xước, bảo vệ nội thất, k&eacute;o d&agrave;i tuổi thọ hệ thống điện trong xe.Bạt phủ xe tr&aacute;ng nh&ocirc;m được l&agrave;m từ chất liệu vải cao cấp 2 mặt dầy dặn, vải mềm như quần &aacute;o thường, với đường may tinh tế, chắc chắn v&agrave; linh phụ kiện tốt. Mặt trong mềm tr&aacute;nh l&agrave;m xước xe.&nbsp;</h2>', 6000000, NULL, 0, 0, 1, NULL, '2019-08-23 16:45:57', '2019-08-23 16:45:57', NULL],
            [164, 11, 'cần mua bỉm Pampers', NULL, 11, '<p><strong>T&atilde; Quần Pampers G&oacute;i Đại L54 [54 Miếng]</strong></p>\r\n\r\n<p>Với l&otilde;i gel thần kỳ,&nbsp;<strong>T&atilde; Quần Pampers G&oacute;i Đại L54 [54 Miếng]&nbsp;</strong>c&oacute; khả năng giữ lượng nước gấp 6 lần b&eacute; t&egrave;, gi&uacute;p b&eacute; lu&ocirc;n kh&ocirc; tho&aacute;ng đến 12 giờ. Mặt đ&aacute;y bằng b&ocirc;ng nhẹ nh&agrave;ng được phủ lớp sữa dưỡng da giữ cho da b&eacute; kh&ocirc;ng tiếp x&uacute;c với nước tiểu tr&aacute;nh bị hăm t&atilde; v&agrave; lu&ocirc;n mềm mại.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Th&ocirc;ng tin sản phẩm</strong></p>\r\n\r\n<p><strong>L&otilde;i gel thần kỳ giữ b&eacute; kh&ocirc; tho&aacute;ng suốt 12 giờ</strong></p>\r\n\r\n<p><strong>T&atilde; Quần Pampers&nbsp;</strong>với thiết kế độc đ&aacute;o chứa l&otilde;i gel thần kỳ đặc biệt, gi&uacute;p t&atilde; thấm h&uacute;t cực tốt. T&atilde; quần Pamper gi&uacute;p b&eacute; kh&ocirc; tho&aacute;ng suốt 12 giờ đồng hồ, cho mẹ v&agrave; b&eacute; cả đ&ecirc;m d&agrave;i ngon giấc.</p>\r\n\r\n<p><strong>Thấm h&uacute;t vượt trội</strong></p>\r\n\r\n<p><strong>T&atilde; Quần Pampers&nbsp;</strong>được đ&aacute;nh gi&aacute; c&oacute; khả năng thấm h&uacute;t vượt trội. Sản phẩm c&oacute; thể thấm h&uacute;t được 6 lần t&egrave; của b&eacute;. Gi&uacute;p b&eacute; lu&ocirc;n nhẹ nh&agrave;ng kh&ocirc; tho&aacute;ng để thoải m&aacute;i vận động v&agrave; t&igrave;m hiểu xung quanh</p>', 50000, NULL, 0, 1, 1, NULL, '2019-08-23 17:02:07', '2019-08-23 17:02:07', NULL],
            [165, 11, 'cần mua Sữa Enfamil A +', NULL, 11, '<p><strong>&quot;Sữa mẹ l&agrave; thức ăn tốt nhất cho sức khỏe v&agrave; sự ph&aacute;t triển to&agrave;n diện của trẻ sơ sinh v&agrave; trẻ nhỏ&quot;</strong></p>\r\n\r\n<ul>\r\n	<li><strong>CRM - Sữa Enfamil A + 1 360&deg; Brain DHA+ MFGM PRO [400g]&nbsp;</strong>l&agrave; sản phẩm dinh dưỡng c&ocirc;ng thức cho trẻ từ 0-6 th&aacute;ng tuổi. C&ocirc;ng thức bổ sung DHA, ARA, Choline v&agrave; c&aacute;c vi chất dinh dưỡng thiết yếu cho chế độ ăn h&agrave;ng ng&agrave;y cho trẻ bị thiếu hoặc kh&ocirc;ng c&oacute; sữa mẹ, hỗ trợ ph&aacute;t triển n&atilde;o bộ v&agrave; to&agrave;n diện của trẻ.</li>\r\n	<li>Sản phẩm c&oacute; chứa MFGM PRO l&agrave; một m&agrave;ng gi&agrave;u dinh dưỡng bao quanh giọt chất b&eacute;o được b&agrave;i tiết v&agrave;o sữa, được chứng minh đ&oacute;ng vai tr&ograve; quan trọng trong việc cải thiện chức năng nhận thức, khả năng miễn dịch v&agrave; sức khỏe đường ruột của trẻ.</li>\r\n	<li>DHA &amp; ARA&nbsp;gi&uacute;p ph&aacute;t triển tr&iacute; n&atilde;o v&agrave; thị lực, được chứng minh l&acirc;m s&agrave;n gi&uacute;p cải thiện sức khỏe đường h&ocirc; hấp.</li>\r\n	<li>PDX GOS gi&uacute;p ph&aacute;t triển lợi khuẩn trong to&agrave;n bộ ruột gi&agrave;, hỗ trợ ti&ecirc;u h&oacute;a v&agrave; l&agrave;m mềm ph&acirc;n, gi&uacute;p b&eacute; ăn ngon, dễ tăng c&acirc;n.</li>\r\n	<li>VITAMIN &amp; KHO&Aacute;NG CHẤT hỗ trợ miễn dịch, tăng sức đề kh&aacute;ng. Hỗ trợ ph&aacute;t triển thể chất to&agrave;n diện.</li>\r\n</ul>', 2500000, NULL, 0, 1, 1, NULL, '2019-08-23 17:03:30', '2019-08-23 17:03:30', NULL],
            [166, 11, 'Bán Kem Đánh Răng ', 11, NULL, '<p>&bull;Kh&ocirc;ng&nbsp;chứa&nbsp;chất&nbsp;SLS, Fluoride v&agrave; Saccharin</p>\r\n\r\n<p>&bull;100%&nbsp;nguồn&nbsp;gốc&nbsp;tự&nbsp;nhi&ecirc;n</p>\r\n\r\n<p>&bull;Chiết&nbsp;xuất&nbsp;hoa&nbsp;c&uacute;c&nbsp;hữu&nbsp;cơ&nbsp;v&agrave;&nbsp;tr&agrave;&nbsp;xanh&nbsp;chống&nbsp;&ocirc;-xi&nbsp;h&oacute;a&nbsp;cho rang v&agrave; nướu</p>\r\n\r\n<p>&bull;</p>\r\n\r\n<p>Chất&nbsp;lượng:</p>\r\n\r\n<p>&bull;An&nbsp;to&agrave;n&nbsp;nếu&nbsp;chẳng&nbsp;may&nbsp;nuốt&nbsp;lượng&nbsp;nhỏ</p>', 600000, NULL, 0, 0, 1, NULL, '2019-08-23 17:05:05', '2019-08-23 17:05:05', NULL],
            [167, 11, 'bán  Nôi Vải Zaracos', 11, NULL, '<ul>\r\n	<li><strong>N&ocirc;i Vải Zaracos Jelly 6046 Yellow&nbsp;</strong>gi&uacute;p bạn tiết kiệm kh&ocirc;ng gian.</li>\r\n	<li>C&oacute; thể gấp gọn th&agrave;nh 1 t&uacute;i h&igrave;nh chữ nhật với k&iacute;ch thước 30.5 x 30.5 x 78cm.</li>\r\n	<li>Tiện lợi khi đưa b&eacute; du lịch v&agrave; đặc biệt tạo sự thoải m&aacute;i, an to&agrave;n cho b&eacute; y&ecirc;u khi ngủ.</li>\r\n	<li>Khung sườn được l&agrave;m từ nh&ocirc;m chịu lực, độ thẩm mỹ cao, khung n&ocirc;i chắc chắn.</li>\r\n	<li>Chất liệu vải an to&agrave;n v&agrave; tho&aacute;ng kh&iacute;, b&eacute; sẽ ngủ ngon giấc v&agrave; thoải m&aacute;i.</li>\r\n	<li>Cũi di chuyển dễ d&agrave;ng nhờ c&oacute; b&aacute;nh xe.</li>\r\n	<li>Cũi c&oacute; n&ocirc;i nhỏ để thay bỉm v&agrave; t&atilde; cho b&eacute; [&lt; 10kg].</li>\r\n</ul>', 600000, NULL, 0, 0, 1, NULL, '2019-08-23 17:07:14', '2019-08-23 17:07:14', NULL],
            [168, 14, 'Bán  Sữa Tắm Trẻ Em', 14, NULL, '<ul>\r\n	<li><strong>Sữa Tắm Trẻ Em Arau Baby [450mL] Tặng T&uacute;i Tắm [400mL]</strong>&nbsp;với th&agrave;nh phần 100% thảo mộc tự nhi&ecirc;n gồm tinh dầu oải hương, tinh dầu chanh, chiết xuất l&aacute; t&iacute;a t&ocirc; v&agrave; l&aacute; hương thảo.</li>\r\n	<li>Kh&ocirc;ng c&oacute; chất phụ gia, chất tạo m&agrave;u, tạo m&ugrave;i v&agrave; chất bảo quản. An to&agrave;n cho sức khỏe.</li>\r\n	<li>C&ocirc;ng dụng: L&agrave;m sạch, giữ mịn v&agrave; tr&aacute;nh k&iacute;ch ứng cho l&agrave;n da nhạy cảm của trẻ.</li>\r\n</ul>', 250000, NULL, 0, 0, 1, NULL, '2019-08-23 17:09:45', '2019-08-23 17:09:45', NULL],
            [169, 14, 'Bán Mũ Bảo Vệ Đầu', 14, NULL, '<p><strong>Mũ Bảo Vệ Đầu Cho B&eacute; Mumguard H&igrave;nh Bọ C&aacute;nh Cam - Đỏ</strong>&nbsp;c&oacute; trọng lượng rất nhẹ, dưới 100g c&ugrave;ng hệ thống c&aacute;c lỗ th&ocirc;ng kh&iacute; sẽ gi&uacute;p b&eacute; cảm thấy thoải m&aacute;i, th&ocirc;ng tho&aacute;ng khi đội. Mũ được gia c&ocirc;ng tại Việt Nam với c&aacute;c vật liệu nhập trực tiếp từ Italy v&agrave; H&agrave;n Qu&ocirc;c, rất an to&agrave;n với sức khỏe của b&eacute;, để ba mẹ an t&acirc;m khi cho con em m&igrave;nh sử dụng. Mũ&nbsp;sẽ hỗ trợ bảo vệ b&eacute; y&ecirc;u của bạn trong những năm th&aacute;ng đầu đời với thiết kế an to&agrave;n c&ugrave;ng chất liệu cao cấp.</p>', 600000, NULL, 1, 0, 1, NULL, '2019-08-23 17:11:47', '2019-08-23 17:11:47', NULL],
            [170, 14, 'Bán mũ Headguard', 14, NULL, '<ul>\r\n	<li><strong>Mũ Bảo Vệ Đầu Cho B&eacute; Headguard Doreamon Xanh</strong>&nbsp;thiết kế m&agrave;u xanh đẹp mắt, nổi bật với 2 tai chuột thật ngộ nghĩnh b&ecirc;n tr&ecirc;n mang lại vẻ ngo&agrave;i trẻ trung v&agrave; năng động cho b&eacute; y&ecirc;u nh&agrave; bạn khi vui chơi, vận động.</li>\r\n	<li>Mũ được l&agrave;m từ c&aacute;c chất liệu: Eva, vải, thun si&ecirc;u bền, bảo vệ đầu khỏi lực va đập tốt. C&aacute;c chất liệu n&agrave;y si&ecirc;u nhẹ n&ecirc;n kh&ocirc;ng đ&egrave; nặng l&ecirc;n đầu v&agrave; cổ b&eacute;, mang lại cảm gi&aacute;c thoải m&aacute;i tối ưu, cho con thỏa sức chạy nhảy.</li>\r\n	<li>Mũ bảo vệ đầu cho b&eacute; HeadGuard được trang bị lớp đệm &ecirc;m &aacute;i d&agrave;y 2.5 cm gi&uacute;p bảo vệ to&agrave;n bộ v&ugrave;ng tr&aacute;n, b&ecirc;n cạnh v&agrave; ph&iacute;a sau đầu. Lớp đệm n&agrave;y c&oacute; độ h&uacute;t ẩm cao vừa an to&agrave;n vừa kh&ocirc;ng l&agrave;m b&eacute; bị đau, kh&ocirc;ng g&acirc;y b&iacute; b&aacute;ch, cho b&eacute; cảm gi&aacute;c dễ chịu suốt thời gian đội mũ.</li>\r\n</ul>', 250000, NULL, 0, 0, 1, NULL, '2019-08-23 17:30:15', '2019-08-23 17:30:15', NULL],
            [171, 14, 'BÁn Máy Giặt Sấy', 14, NULL, '<h3>Thiết kế hiện đại, khối lượng giặt lớn</h3>\r\n\r\n<p>M&aacute;y giặt sấy cửa trước Inverter LG F2514DTGW với thiết kế m&agrave;u đen v&ocirc; c&ugrave;ng sang trọng, c&ugrave;ng khối lượng giặt l&ecirc;n đến 14 kg, khối lượng sấy 8 kg, gi&uacute;p bạn tiết kiệm rất nhiều thời gian trong c&ocirc;ng việc giặt giũ của gia đ&igrave;nh, đặc biệt trong thời gian m&ugrave;a mưa k&eacute;o d&agrave;i.</p>', 18000000, NULL, 1, 0, 1, NULL, '2019-08-23 17:32:41', '2019-08-23 17:32:41', NULL],
            [172, 14, 'Máy Lạnh Daikin', 14, NULL, '<p>Thiết kế bắt mắt, sang trọng</p>\r\n\r\n<p><strong>M&aacute;y Lạnh Daikin FTKC50TVMV</strong>&nbsp;với sắc trắng trung tính, kết hợp với dạng chữ nhật mang cảm gi&aacute;c cứng c&aacute;p v&agrave; chắc chắn. Điểm nhấn cho d&ograve;ng Daikin đ&oacute; l&agrave; mặt trước được thiết kế với một đường cong, sẽ mang đến sự hiện đại, thanh lịch cho kh&ocirc;ng gian của gia đ&igrave;nh bạn.</p>\r\n\r\n<p>C&ocirc;ng suất l&agrave;m lạnh 2HP</p>\r\n\r\n<p>Với c&ocirc;ng suất l&agrave;m lạnh 2HP, m&aacute;y lạnh Daikin rất ph&ugrave; hợp với kh&ocirc;ng gian ph&ograve;ng kh&aacute;ch, ph&ograve;ng l&agrave;m việc, ph&ograve;ng ngủ vừa v&agrave; nhỏ, diện t&iacute;ch dưới 40 m&eacute;t vu&ocirc;ng,&nbsp;mang lại những luồng kh&ocirc;ng kh&iacute; m&aacute;t lạnh cho bạn v&agrave; cả nh&agrave; lu&ocirc;n cảm thấy thoải m&aacute;i v&agrave; dễ chịu nhất.</p>\r\n\r\n<p>C&ocirc;ng nghệ inverter tiết kiệm điện</p>\r\n\r\n<p>Khi đ&atilde; đạt đến nhi&ecirc;t độ c&agrave;i đặt, c&ocirc;ng nghệ biến tần Inverter sẽ kiểm so&aacute;t m&aacute;y hạ c&ocirc;ng suất xuống, đủ để đảm bảo độ m&aacute;t nhưng tận dụng tối đa nguồn năng lượng để tiết kiệm điện năng. Với c&ocirc;ng nghệ n&agrave;y, bạn c&oacute; thể tiết kiệm từ 40 - 60% điện năng so với c&aacute;c loại m&aacute;y lạnh th&ocirc;ng thường.</p>', 29000000, NULL, 1, 0, 1, NULL, '2019-08-23 17:36:10', '2019-08-23 17:36:10', NULL],
            [173, 14, 'bán Lọ hoa thủy tinh', 14, NULL, '<p>CHI TIẾT SẢN PHẨM</p>\r\n\r\n<p>B&igrave;nh B&ocirc;ng D&aacute;ng Bầu Dục Nhỏ</p>\r\n\r\n<p>Chiều cao 13.5cm</p>\r\n\r\n<p>Đường k&iacute;nh miệng 8.2cm</p>\r\n\r\n<p>Đường k&iacute;nh th&acirc;n 9.8cm</p>\r\n\r\n<p>Đường k&iacute;nh đ&aacute;y 6.8cm</p>', 90000, NULL, 1, 0, 1, NULL, '2019-08-23 17:38:13', '2019-08-23 17:38:13', NULL],
            [174, 14, 'Nước cắm hoa ASA', 14, NULL, '<p><strong>Nước cắm hoa&nbsp;&nbsp;giữ hoa tươi l&acirc;u ASA&nbsp; 400 ml</strong></p>\r\n\r\n<p>Một sản phẩm th&acirc;n thiện với thi&ecirc;n nhi&ecirc;n, gi&uacute;p cho hoa tươi l&acirc;u hơn gấp hai lần m&agrave; kh&ocirc;ng cần phải thay nước v&agrave; cắt gốc h&agrave;ng ng&agrave;y, đặc biệt nước sẽ kh&ocirc;ng bị thối như khi ch&uacute;ng ta cắm hoa với nước thường. Sản phẩm thật tiện dụng gi&uacute;p tiết kiệm thời gian v&agrave; chi ph&iacute; của người ti&ecirc;u d&ugrave;ng.</p>', 60000, NULL, 0, 0, 1, NULL, '2019-08-23 17:39:50', '2019-08-23 17:39:50', NULL],
            [175, 14, 'Bán đồng hồ treo tương', 14, NULL, '<p><img alt=\"uXqHY2_simg_d0daf0_800x1200_max.jpg\" src=\"https://media3.scdn.vn/img3/2019/6_23/uXqHY2_simg_d0daf0_800x1200_max.jpg\" /></p>\r\n\r\n<p>-&nbsp;Chất liệu:&nbsp;<em>&nbsp;<strong>Đồng hồ treo tường&nbsp;</strong></em>Exactly. Model: U450 sử dụng chất liệu nhựa cao cấp, th&acirc;n thiện m&ocirc;i trường.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;Thiết kế:&nbsp;Hiện đại, sinh động, sang trọng.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;Chất lượng:&nbsp;Sản phẩm&nbsp;<strong>đồng hồ treo tường Exactly</strong>,&nbsp;&nbsp;<strong>M&aacute;y&nbsp;Đ&agrave;i Loan kim tr&ocirc;i</strong>, sử dụng pin tiểu AA/1,5V.&nbsp; Đươc kiễm tra kỹ lưỡng từ m&aacute;y, kim đồng hồ cho đến bề mặt k&iacute;nh, c&aacute;c&nbsp;g&oacute;c cạnh&nbsp;tất cả phải đảm bảo độ nhẵn, b&oacute;ng v&agrave; ph&ugrave; hợp với ti&ecirc;u ch&iacute; chất lượng của C&ocirc;ng ty.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;Tiện dụng:&nbsp;Đồng hồ được thiết&nbsp;kế c&oacute; r&atilde;nh ph&iacute;a sau để c&oacute; thể treo dễ d&agrave;ng bằng m&oacute;c d&aacute;n tường hoặc đinh th&ocirc;ng thường. Hộp v&agrave; bao b&igrave; được thiết kế trang nh&atilde;, tinh tế gi&uacute;p bảo quản sản phẩm v&agrave; sẳn s&agrave;ng để l&agrave;m qu&agrave; tặng người th&acirc;n, bạn b&egrave; v&agrave; kh&aacute;ch h&agrave;ng.</p>', 600000, NULL, 1, 0, 1, NULL, '2019-08-23 17:41:51', '2019-08-23 17:41:51', NULL],
            [176, 14, 'Mua đồng hồ', NULL, 14, '<p><img alt=\"uXqHY2_simg_d0daf0_800x1200_max.jpg\" src=\"https://media3.scdn.vn/img3/2019/6_23/uXqHY2_simg_d0daf0_800x1200_max.jpg\" /></p>\r\n\r\n<p>-&nbsp;Chất liệu:&nbsp;<em>&nbsp;<strong>Đồng hồ treo tường&nbsp;</strong></em>Exactly. Model: U450 sử dụng chất liệu nhựa cao cấp, th&acirc;n thiện m&ocirc;i trường.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;Thiết kế:&nbsp;Hiện đại, sinh động, sang trọng.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;Chất lượng:&nbsp;Sản phẩm&nbsp;<strong>đồng hồ treo tường Exactly</strong>,&nbsp;&nbsp;<strong>M&aacute;y&nbsp;Đ&agrave;i Loan kim tr&ocirc;i</strong>, sử dụng pin tiểu AA/1,5V.&nbsp; Đươc kiễm tra kỹ lưỡng từ m&aacute;y, kim đồng hồ cho đến bề mặt k&iacute;nh, c&aacute;c&nbsp;g&oacute;c cạnh&nbsp;tất cả phải đảm bảo độ nhẵn, b&oacute;ng v&agrave; ph&ugrave; hợp với ti&ecirc;u ch&iacute; chất lượng của C&ocirc;ng ty.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-&nbsp;Tiện dụng:&nbsp;Đồng hồ được thiết&nbsp;kế c&oacute; r&atilde;nh ph&iacute;a sau để c&oacute; thể treo dễ d&agrave;ng bằng m&oacute;c d&aacute;n tường hoặc đinh th&ocirc;ng thường. Hộp v&agrave; bao b&igrave; được thiết kế trang nh&atilde;, tinh tế gi&uacute;p bảo quản sản phẩm v&agrave; sẳn s&agrave;ng để l&agrave;m qu&agrave; tặng người th&acirc;n, bạn b&egrave; v&agrave; kh&aacute;ch h&agrave;ng.</p>', 600000, NULL, 1, 1, 1, NULL, '2019-08-23 17:43:33', '2019-08-23 17:43:33', NULL],
            [177, 14, 'Mua lịch gỗ', NULL, 14, '<p><strong>Lịch khối gỗ&nbsp;Bắc &Acirc;u Sweet Home&nbsp;để b&agrave;n&nbsp; l&agrave; mẫu lịch độc đ&aacute;o s&aacute;ng tạo theo phong c&aacute;ch Bắc &Acirc;u. Được thiết kế đơn giản nhưng mang đầy t&iacute;nh s&aacute;ng tạo, sản phẩm lịch khối gỗ để b&agrave;n sẽ mang đến cho kh&ocirc;ng gian của bạn phong c&aacute;ch trang tr&iacute; hiện đại ấn tượng, l&agrave; m&oacute;n qu&agrave; tặng người th&acirc;n bạn b&egrave; th&uacute; vị độc đ&aacute;o.</strong></p>', 900000, NULL, 1, 1, 1, NULL, '2019-08-23 17:46:14', '2019-08-23 17:46:14', NULL],
            [178, 14, 'Mua Máy tính bảng', NULL, 14, '<h2><a href=\"https://www.thegioididong.com/may-tinh-bang/samsung-galaxy-tab-a-101-t515-2019\" target=\"_blank\">Samsung Galaxy Tab A 10.1 T515 [2019]</a>&nbsp;l&agrave; chiếc&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang\" target=\"_blank\">m&aacute;y t&iacute;nh bảng</a>&nbsp;c&oacute; m&agrave;n h&igrave;nh lớn c&ugrave;ng cấu h&igrave;nh vừa phải đ&aacute;p ứng tốt cho bạn trong hầu hết c&aacute;c nhu cầu giải tr&iacute; hằng ng&agrave;y.</h2>\r\n\r\n<h3>M&agrave;n h&igrave;nh k&iacute;ch thước lớn, sử dụng thoải m&aacute;i</h3>\r\n\r\n<p>Với m&agrave;n h&igrave;nh k&iacute;ch thước lớn l&ecirc;n tới 10.1 inch th&igrave; chiếc&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang-samsung\" target=\"_blank\">m&aacute;y t&iacute;nh bảng Samsung</a>&nbsp;gi&uacute;p bạn c&oacute; một kh&ocirc;ng gian lớn hơn để c&oacute; thể l&agrave;m việc hay giải tr&iacute;.</p>', 9000000, NULL, 1, 1, 1, NULL, '2019-08-23 17:49:26', '2019-08-23 17:49:26', NULL],
            [179, 14, 'Bán ipad wifi', 14, NULL, '<h3><strong>Cấu h&igrave;nh mạnh, bộ nhớ trong cực lớn</strong></h3>\r\n\r\n<p>Bộ nhớ trong của m&aacute;y c&oacute; dung lượng l&ecirc;n đến l&agrave; 128 GB cho ph&eacute;p người d&ugrave;ng c&oacute; thể thoải m&aacute;i lưu trữ dữ liệu m&agrave; kh&ocirc;ng phải sợ hết dung lượng.</p>\r\n\r\n<p>M&aacute;y t&iacute;nh bảng iPad 6th Wifi Cellular 128 GB c&oacute; những cải tiến mới vượt bậc trong vấn đề xử l&yacute; đồ họa để hỗ trợ tối đa cho ứng dụng AR [thực tế tăng cường].</p>\r\n\r\n<p>&nbsp;</p>', 12000000, NULL, 1, 0, 1, NULL, '2019-08-23 17:51:13', '2019-08-23 17:51:13', NULL],
            [180, 14, 'Bán Dell 3485', 14, NULL, '<h2><a href=\"https://www.thegioididong.com/laptop/dell-inspiron-3480-i3-8145u-4gb-1tb-win10-nt4x01\" target=\"_blank\">Laptop Dell Inspiron 3480</a>&nbsp;thuộc d&ograve;ng&nbsp;<a href=\"https://www.thegioididong.com/laptop\" target=\"_blank\">laptop</a>&nbsp;tầm trung của h&atilde;ng Dell với cấu h&igrave;nh kh&aacute; mạnh, thiết kế đẹp v&agrave; sang trọng. M&aacute;y hướng tới đối tượng nh&acirc;n vi&ecirc;n văn ph&ograve;ng v&agrave; c&aacute;c bạn học sinh, sinh vi&ecirc;n.</h2>\r\n\r\n<h3>Cấu h&igrave;nh đ&aacute;p ứng c&aacute;c t&aacute;c vụ văn ph&ograve;ng, đa nhiệm ổn</h3>\r\n\r\n<p><a href=\"https://www.thegioididong.com/laptop-dell\" target=\"_blank\">Laptop Dell</a>&nbsp;Inspiron 3480 được trang bị&nbsp;<strong>Chip Intel&nbsp;<a href=\"https://www.thegioididong.com/laptop?g=core-i3\" target=\"_blank\">Core i3</a></strong>&nbsp;đời thứ 8 v&agrave;<strong>&nbsp;RAM 4 GB&nbsp;</strong>gi&uacute;p m&aacute;y chạy được hầu hết c&aacute;c ứng dụng văn ph&ograve;ng, xử l&yacute; đa nhiệm ổn. Đ&acirc;y l&agrave; lựa chọn tốt nhất hầu hết cho mọi người d&ugrave;ng.</p>', 5000000, NULL, 1, 0, 1, NULL, '2019-08-23 17:53:19', '2019-08-23 17:53:19', NULL],
            [181, 14, 'Iphone XS Max 256GB', 14, NULL, '<h2>Sau 1 năm mong chờ, chiếc&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">smartphone</a>&nbsp;cao cấp nhất của Apple đ&atilde; ch&iacute;nh thức ra mắt mang t&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/dtdd/iphone-xs-max-256gb\" target=\"_blank\">iPhone Xs Max</a>. M&aacute;y&nbsp;c&aacute;c trang bị c&aacute;c t&iacute;nh năng cao cấp nhất từ chip A12 Bionic, d&agrave;n loa đa chiều cho tới camera k&eacute;p t&iacute;ch hợp tr&iacute; tuệ nh&acirc;n tạo.</h2>\r\n\r\n<h3>Hiệu năng đỉnh cao c&ugrave;ng chip Apple A12</h3>\r\n\r\n<p>iPhone Xs Max được Apple trang bị cho con chip mới toanh h&agrave;ng đầu của h&atilde;ng mang t&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/tin-tuc/chi-tiet-chip-apple-a12-bionic-ben-trong-iphone-xs-xs-max-1116982\" target=\"_blank\">Apple A12</a>.</p>\r\n\r\n<p>Chip A12 Bionic được x&acirc;y dựng tr&ecirc;n tiến tr&igrave;nh 7nm đầu ti&ecirc;n m&agrave; h&atilde;ng sản xuất với 6 nh&acirc;n đ&aacute;p ứng vượt trội trong việc xử l&yacute; c&aacute;c t&aacute;c vụ v&agrave; khả năng tiết kiệm năng lượng tối ưu.</p>', 12000000, NULL, 1, 0, 1, NULL, '2019-08-23 17:54:46', '2019-08-23 17:54:46', NULL],
            [182, 14, 'Bán huawei P30', 14, NULL, '<h2>Mới đ&acirc;y Huawei đ&atilde; ch&iacute;nh thức giới thiệu chiếc&nbsp;<a href=\"https://www.thegioididong.com/dtdd/huawei-p30-lite\" target=\"_blank\">Huawei P30 Lite</a>&nbsp;b&ecirc;n cạnh c&aacute;c sản phẩm kh&aacute;c trong d&ograve;ng P30 series v&agrave; chiếc&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">smartphone</a>&nbsp;được định hướng tới ph&acirc;n kh&uacute;c tầm trung.</h2>\r\n\r\n<h3>Camera vẫn rất nổi bật trong ph&acirc;n kh&uacute;c</h3>\r\n\r\n<p>Điểm nhấn đ&aacute;ng ch&uacute; &yacute; nhất tr&ecirc;n chiếc&nbsp;<a href=\"https://www.thegioididong.com/dtdd-huawei\" target=\"_blank\">điện thoại Huawei</a>&nbsp;l&agrave; hệ thống 3 camera sau bao gồm cảm biến ch&iacute;nh 24 MP [khẩu độ f/.8], cảm biến độ s&acirc;u 2 MP v&agrave; cảm biến 8 MP hỗ trợ chụp g&oacute;c rộng.</p>', 4000000, NULL, 1, 0, 1, NULL, '2019-08-23 17:57:16', '2019-08-23 17:57:16', NULL],
            [183, 15, 'bán galaxy s10+', 15, NULL, '<h2><a href=\"https://www.thegioididong.com/dtdd/samsung-galaxy-s10-plus\" target=\"_blank\">Samsung Galaxy S10+</a>&nbsp;đ&atilde; ra mắt v&agrave; thực sự người d&ugrave;ng kh&oacute; c&oacute; thể cường lại sức h&uacute;t kỳ lạ tới từ si&ecirc;u phẩm n&agrave;y của Samsung v&agrave; giờ đ&acirc;y h&atilde;ng sản xuất smartphone tới từ H&agrave;n Quốc tiếp tục tung ra phi&ecirc;n bản&nbsp;<a href=\"https://www.thegioididong.com/dtdd/samsung-galaxy-s10-plus-128gb-bac-da-sac\" target=\"_blank\">Samsung Galaxy S10+ 128GB Bạc Đa Sắc</a>&nbsp;thậm ch&iacute; c&ograve;n thu h&uacute;t hơn c&aacute;c phi&ecirc;n bản cũ.</h2>\r\n\r\n<h3>Phi&ecirc;n bản giới hạn với bộ phụ kiện cao cấp</h3>\r\n\r\n<p>Kh&aacute;c biệt ho&agrave;n to&agrave;n với phi&ecirc;n bản S10+ th&ocirc;ng thường, chiếc điện thoại S10+ Park Hang Seo [Bạc Đa Sắc] n&agrave;y sở hữu bộ phụ kiện độc đ&aacute;o kh&ocirc;ng m&aacute;y n&agrave;o c&oacute; được.</p>', 5000000, NULL, 1, 0, 1, NULL, '2019-08-23 18:00:01', '2019-08-23 18:00:01', NULL],
            [184, 15, 'Bán Smart Tivi LG', 15, NULL, '<h3>Thiết kế thanh lịch, tinh tế</h3>\r\n\r\n<p><a href=\"https://www.dienmayxanh.com/tivi/lg-49sm8100pta\" target=\"_blank\">Smart Tivi LG 4K 49 inch 49SM8100PTA</a>&nbsp;c&oacute; thiết kế ch&acirc;n trụ mang kiểu d&aacute;ng b&aacute;n nguyệt độc đ&aacute;o, thanh lịch v&agrave; tinh tế nhưng vẫn đảm bảo khả năng trụ vững cho sản phẩm khi đặt ở bất k&igrave; mặt phẳng n&agrave;o.</p>\r\n\r\n<p>Đi c&ugrave;ng k&iacute;ch thước m&agrave;n h&igrave;nh 49 inch, chiếc&nbsp;<a href=\"https://www.dienmayxanh.com/tivi?g=smart-tivi\" target=\"_blank\">Smart Tivi</a>&nbsp;n&agrave;y sẽ m&agrave; một sự lựa chọn l&yacute; tưởng cho những kh&ocirc;ng gian rộng r&atilde;i như ph&ograve;ng kh&aacute;ch lớn, ph&ograve;ng l&agrave;m việc, ph&ograve;ng họp,...</p>', 2500000, NULL, 0, 0, 1, NULL, '2019-08-23 18:01:55', '2019-08-23 18:01:55', NULL],
