            [186, 15, 'Bán Mobell Tab 8A', 15, NULL, '<h2>Thiết kế trẻ trung, năng động -&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang/may-tinh-bang-mobell-tab-8a\" target=\"_blank\">Mobell Tab 8a</a>, một chiếc&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang-mobell\" target=\"_blank\">m&aacute;y t&iacute;nh bảng Mobell</a>vừa được ra mắt năm 2018. Cấu h&igrave;nh m&aacute;y đủ đ&aacute;p ứng tốt c&aacute;c nhu cầu sử dụng hằng ng&agrave;y như xem phim, lướt web, đọc b&aacute;o.</h2>\r\n\r\n<h3>Thiết kế đơn giản, hiện đại</h3>\r\n\r\n<p>M&aacute;y được ho&agrave;n thiện từ chất liệu nhựa, c&aacute;c cạnh bo cong chắc chắn khi cầm nắm. Mặt k&iacute;nh ph&iacute;a trước của m&aacute;y &ocirc;m ra đến viền tạo sự sang trọng, mặt sau được l&agrave;m trau chuốt với phần giữa m&aacute;y thiết kế giả kim loại hiện đại v&agrave; đẹp mắt.</p>', 5000000, NULL, 1, 0, 1, NULL, '2019-08-23 18:06:18', '2019-08-23 18:06:18', NULL],
            [187, 15, 'Bán Tab A 10.5\"', 15, NULL, '<h2>L&agrave; một phi&ecirc;n bản&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang\" target=\"_blank\">m&aacute;y t&iacute;nh bảng</a>&nbsp;gi&aacute; rẻ của d&ograve;ng Tab S4,&nbsp;<a href=\"https://www.thegioididong.com/may-tinh-bang/samsung-galaxy-tab-a-105-inch\" target=\"_blank\">Samsung Galaxy Tab A 10.5&nbsp;inch</a>&nbsp;c&oacute; gi&aacute; b&aacute;n phải chăng v&agrave; phục vụ tốt nhu cầu sử dụng của người d&ugrave;ng.</h2>\r\n\r\n<h3>M&agrave;n h&igrave;nh rộng, thoải m&aacute;i lướt web, xem phim</h3>\r\n\r\n<p>Samsung Galaxy Tab A 10.5 inch được trang bị m&agrave;n h&igrave;nh IPS LCD với độ ph&acirc;n giải&nbsp;1.920 x 1.200 pixels, viền bezels được l&agrave;m mỏng cho h&igrave;nh ảnh hiển thị chi tiết dễ d&agrave;ng đọc s&aacute;ch hay xem phim phụ đề m&agrave; kh&ocirc;ng sợ bị mỏi mắt.</p>', 21000000, NULL, 0, 0, 1, NULL, '2019-08-23 18:07:53', '2019-08-23 18:07:53', NULL],
            [188, 15, 'Bán Galaxy Note 10', 15, NULL, '<h2>Nếu như từ trước tới nay d&ograve;ng Galaxy Note của&nbsp;<a href=\"https://www.thegioididong.com/dtdd-samsung\" target=\"_blank\">Samsung</a>&nbsp;thường &iacute;t được c&aacute;c bạn nữ sử dụng bởi k&iacute;ch thước m&agrave;n h&igrave;nh kh&aacute; lớn khiến việc cầm nắm trở n&ecirc;n kh&oacute; khăn th&igrave;&nbsp;<a href=\"https://www.thegioididong.com/dtdd/samsung-galaxy-note-10\" target=\"_blank\">Samsung Galaxy Note 10</a>&nbsp;sẽ l&agrave; chiếc smartphone nhỏ gọn, ph&ugrave; hợp với cả những bạn c&oacute; b&agrave;n tay nhỏ.</h2>\r\n\r\n<h3>M&agrave;n h&igrave;nh tr&agrave;n viền tuyệt đẹp</h3>\r\n\r\n<p>M&agrave;n h&igrave;nh tr&ecirc;n Galaxy Note 10 l&agrave; đ&aacute;nh dấu sự đổi mới về thiết kế của Samsung.</p>', 26000000, NULL, 0, 0, 1, NULL, '2019-08-23 18:09:41', '2019-08-23 18:09:41', NULL],
            [189, 15, 'Mũ cao bồi', 15, NULL, '<p>THƠI TRANG SỈ- CHUY&Ecirc;N SỈ LẺ THƠI TRANG, PHỤ KIỆN THỜI TRANG.</p>\r\n\r\n<p>- LH: 0987 961230</p>\r\n\r\n<p>- SHop: 226 đường M1, KCN T&acirc;n B&igrave;nh, P. B&igrave;nh Hưng Ho&agrave;, Q. T&acirc;n B&igrave;nh</p>', 50000, NULL, 0, 0, 1, NULL, '2019-08-23 18:11:35', '2019-08-23 18:11:35', NULL],
            [190, 15, 'Bán con lăn mỡ', 15, NULL, '<p>Con lăn 4 b&aacute;nh tập cơ bụng&nbsp;<br />\r\nSỉ 7x&nbsp;<br />\r\nDụng cụ tập cơ bụng 4 b&aacute;nh được thiết kế si&ecirc;u bền, chịu tải trọng lớn chuy&ecirc;n cho ph&ograve;ng tập GYM v&agrave; ph&ograve;ng tập thể h&igrave;nh.<br />\r\nDụng cụ với thiết kế vượt trội 4 b&aacute;nh theo h&igrave;nh tam gi&aacute;c gi&uacute;p bạn đốt ch&aacute;y mỡ thừa v&agrave; r&egrave;n luyện cho cơ bắp săn chắc v&agrave; h&igrave;nh th&agrave;nh c&aacute;c cơ.<br />\r\nChức năng tập tập, tập chống đẩy b&ecirc;n cạnh đ&oacute; c&ograve;n t&aacute;c dụng hiệu quả tới c&aacute;c cơ vai, cơ li&ecirc;n sườn hay x&ocirc; vai hiệu quả.<br />\r\nSản phẩm b&ecirc;n ngo&agrave;i được bọc lớp cao su mềm nhằm l&agrave;m tăng ma s&aacute;t v&agrave; chống trơn tuột hiệu quả.&nbsp;<br />\r\nTay nắm được thiết kế bằng th&eacute;p inox bọc m&uacute;t cao c&acirc;p chống trơn trượt.<br />\r\nThiết kế với 4 b&aacute;nh xe chắc chắn, hệ thống khung chịu lực nhỏ nhưng cực kỳ chắc chắn.</p>', 250000, NULL, 0, 0, 1, NULL, '2019-08-23 18:13:50', '2019-08-23 18:13:50', NULL],
            [191, 15, 'Bình giữ nhiệt', 15, NULL, '<ul>\r\n	<li><strong>B&igrave;nh Giữ Nhiệt Lock&amp;Lock New Basic Table&nbsp;</strong>l&agrave; sản phẩm được thiết kế với kiểu d&aacute;ng nhỏ gọn kết hợp với m&agrave;u sắc sang trọng, tiện lợi cho bạn mang theo đến văn ph&ograve;ng, trường học hay đi d&atilde; ngoại.&nbsp;&nbsp;</li>\r\n	<li>B&igrave;nh giữ nhiệt được l&agrave;m từ th&eacute;p kh&ocirc;ng gỉ bền đẹp, c&oacute; khả năng giữ n&oacute;ng từ 6 đến 8 tiếng v&agrave; khả năng giữ lạnh khoảng 12 tiếng, gi&uacute;p bạn c&oacute; thể trữ thức uống một c&aacute;ch thoải m&aacute;i v&agrave; an to&agrave;n vệ sinh.</li>\r\n	<li>Sản phẩm c&oacute; phần tay cầm bằng nhựa c&aacute;ch nhiệt gắn liền th&acirc;n chắc chắn, thoải m&aacute;i khi cầm nắm, v&ocirc; c&ugrave;ng th&iacute;ch hợp để trữ nước uống lạnh hoặc n&oacute;ng như tr&agrave;, c&agrave; ph&ecirc;, nước &eacute;p tr&aacute;i c&acirc;y</li>\r\n	<li>Ngo&agrave;i ra, b&igrave;nh giữ nhiệt Lock&amp;Lock c&ograve;n c&oacute; nắp đậy&nbsp;k&iacute;n gi&uacute;p tăng hiệu quả giữ nhiệt v&agrave; ngăn ngừa bụi bẩn, vi khuẩn x&acirc;m nhập, đảm bảo an to&agrave;n vệ sinh thực phẩm.</li>\r\n</ul>', 600000, NULL, 0, 0, 1, NULL, '2019-08-23 18:15:50', '2019-08-23 18:15:50', NULL],
            [192, 1, 'Bán xe Giant Low-Carbon', 1, NULL, '<ul>\r\n	<li><strong>Xe đạp thời trang Giant Low-Carbon City Bike 026 2018&nbsp;</strong>kế thừa những t&iacute;nh năng của một chiếc xe đạp địa h&igrave;nh với cấu tr&uacute;c h&igrave;nh học ti&ecirc;u chuẩn, bộ khung sườn th&eacute;p cảrbon rắn chắc, kh&ocirc;ng m&ocirc;&iacute; h&agrave;n, thắng đĩa v&agrave; phuộc nh&uacute;n nhưng được thiết kế lại với k&iacute;ch thước nhỏ hơn.</li>\r\n	<li>Lớp ngo&agrave;i xe được sơn tĩnh điện b&oacute;ng đẹp v&agrave; c&oacute; độ bền cao. C&aacute;c họa tiết v&agrave; tem xe được sơn tinh tế, m&agrave;u sắc h&agrave;i h&ograve;a dọc theo khung sườn.</li>\r\n	<li>X&iacute;ch, l&iacute;p, v&ograve;ng bi của xe đạp đều c&oacute; độ ch&iacute;nh x&aacute;c v&agrave; độ bền cao. Khung nh&ocirc;m cao cấp, sơn phủ 3D c&ocirc;ng nghệ carbon, c&ocirc;ng nghệ Nhật</li>\r\n	<li>Th&iacute;ch hợp với việc di chuyển h&agrave;ng ng&agrave;y để tập thể dục, đi l&agrave;m hoặc đi đến trường cho học sinh.</li>\r\n	<li>Y&ecirc;n xe bọc da cao cấp, mềm mịn, ngồi l&acirc;u vẫn rất thoải m&aacute;i m&agrave; kh&ocirc;ng hề g&acirc;y cảm gi&aacute;c kh&oacute; chịu. Bộ chuyển động 21 tốc độ [3 tầng đĩa x 7 tầng l&iacute;p] Shimano nhật ch&iacute;nh h&atilde;ng.</li>\r\n	<li>Trục bạc đạn cao cấp.</li>\r\n	<li>Hai phanh đĩa cao cấp &ecirc;m &aacute;i nhẹ nh&agrave;ng m&agrave; lại rất an to&agrave;n.</li>\r\n	<li>V&agrave;nh nh&ocirc;m 2 lớp cao cấp giảm chấn, phuộc nh&uacute;n dầu &ecirc;m &aacute;i.</li>\r\n</ul>', 2500000, NULL, 0, 0, 1, NULL, '2019-08-23 18:18:02', '2019-08-23 18:18:02', NULL],
            [193, 1, 'Iphone XS max 512GB', 1, NULL, '<h2>Đến hẹn lại l&ecirc;n, năm nay Apple giới thiệu tới người d&ugrave;ng thế hệ&nbsp;tiếp theo với 3 phi&ecirc;n bản, trong đ&oacute; c&oacute; c&aacute;i t&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/dtdd/iphone-xs\" target=\"_blank\">iPhone Xs</a>&nbsp;với những n&acirc;ng cấp mạnh mẽ về phần cứng đến hiệu năng, m&agrave;n h&igrave;nh c&ugrave;ng h&agrave;ng loạt c&aacute;c trang bị cao cấp kh&aacute;c.&nbsp;</h2>\r\n\r\n<h3>Hiệu năng đỉnh cao đến từ con&nbsp;<a href=\"https://www.thegioididong.com/tin-tuc/chi-tiet-chip-apple-a12-bionic-ben-trong-iphone-xs-xs-max-1116982\" target=\"_blank\">chip Apple A12</a></h3>\r\n\r\n<p>Ngo&agrave;i&nbsp;<a href=\"https://www.thegioididong.com/dtdd\" target=\"_blank\">điện thoại</a>&nbsp;th&igrave; năm nay&nbsp;<a href=\"https://www.thegioididong.com/dtdd-apple-iphone\" target=\"_blank\">iPhone</a>&nbsp;cũng đ&atilde; ch&iacute;nh thức ra mắt chip A12 bionic thế hệ mới với những n&acirc;ng cấp vượt trội về mặt hiệu năng.</p>', 21000000, NULL, 0, 0, 1, NULL, '2019-08-23 18:19:59', '2019-08-23 18:19:59', NULL],
            [194, 13, 'Bán giày nữ', 13, NULL, '<p>Upper material: Da Lộn</p>\r\n\r\n<p>B&ecirc;n trong vật liệu: vải<br />\r\nChiều cao đế: 5-7cm<br />\r\nChất liệu đế: cao su<br />\r\nM&agrave;u sắc:&nbsp; Đen, Cam, X&aacute;m, Đỏ<br />\r\nK&iacute;ch thước: 36,37,38,39</p>', 600000, NULL, 0, 0, 1, NULL, '2019-08-23 18:22:51', '2019-08-23 18:22:51', NULL],
            [195, 13, 'Bán Honda SH 150i', 13, NULL, '<p>Biểu tượng của sự đẳng cấp</p>\r\n\r\n<p><strong>Xe M&aacute;y Honda SH 150i Phanh ABS 2019&nbsp;</strong>kiệt t&aacute;c thiết kế đậm chất ch&acirc;u &Acirc;u được thổi một luồng gi&oacute; mới với việc bổ sung phi&ecirc;n bản đen mờ c&aacute; t&iacute;nh. Th&acirc;n xe với sắc đen mờ nam t&iacute;nh, logo 3D đỏ nổi bật c&ugrave;ng với sự thay đổi m&agrave;u sắc của c&aacute;c chi tiết như tay dắt sau, b&aacute;nh xe, phuộc trước,đem tới h&igrave;nh ảnh tổng thể mạnh mẽ, ph&oacute;ng kho&aacute;ng v&agrave; đẳng cấp.&nbsp;Phi&ecirc;n bản Honda SH 2019 c&oacute; thể xem l&agrave; sự c&acirc;n bằng giữa thiết kế đặc trưng để bất kỳ ai nh&igrave;n cũng c&oacute; thể nhận ra đ&oacute; l&agrave; SH v&agrave; c&ocirc;ng nghệ hiện đại tr&ecirc;n một chiếc xe đời mới.</p>', 103000000, NULL, 0, 0, 1, NULL, '2019-08-23 18:25:00', '2019-08-23 18:25:00', NULL]
